INSERT INTO `challenges` VALUES (1,'inwi DAYS 2012','<p>Deux journées ouvertes à tous, regroupant des experts internationaux et influenceurs du gaming. Cette deuxième édition, toujours à Casablanca, était axée autour du thème du gaming, qu\'il soit Marocain ou international.</p><p><br></p><p><br></p><p><strong>CONFERENCES ET DEBATS :</strong></p><p>Curieux et passionnés du gaming, du développement et du design sont venus s\'informer sur les technologies et futurs usages liés au gaming.</p><p><br></p><p><strong>LE HACKATHON GAMING :</strong></p><p>Le Hackathon en quelques chiffres, c\'est 100 participants répartis en équipes de 4 maximum, 24h de compétition, 10 minutes pour convaincre et 1 équipe gagnante !</p><p><br></p><p><strong>VOTRE MISSION : </strong></p><p>Concevoir un concept de jeu (web et/ou mobile) inspiré de la culture marocaine, développer les scénarios d\'interactions et illustrer l\'univers graphique du jeu en 24h</p><p><br></p><p><strong>LE GRAND PRIX :</strong></p><p>Les gagnants du concours ont remporté une aide financière de 100 000 dh pour le concept et un partenariat avec inwi pour développer le projet.</p><p><br></p><p>Pour plus d’infos, rendez-vous sur <a href=\"http://inwidays.ma/content/edition-2013\" target=\"_blank\">ce lien</a>.</p>','0000-00-00 00:00:00','Image','1511374258.jpg','2012-10-20 21:21:00','2012-10-21 11:21:00','2017-08-23 20:24:10','2017-12-27 10:41:32','Challenge','Nom de projet','Nom de projet','Obligatoire','Activé','Logo du projet','Logo du projet','Obligatoire','Activé','Nom de l’entité','Nom de l’entité','Obligatoire','Activé','Statut juridique','Statut juridique','Obligatoire','Activé','Logo entité','Logo entité','Obligatoire','Activé','Plein temps OU partiel','Vos missions sont :','Obligatoire','Activé','Nombre de co-équipiers','Nombre de co-équipiers','Obligatoire','Activé','Nombre d’années d’expérience','Nombre d’années d’expérience','Obligatoire','Activé','Expériences et prix','Expériences et prix','Obligatoire','Ac