\'il soit Marocain ou international. CONFERENCES ET DEBATS : Curieux et passionnés du gaming, du développement et du design sont venus s\'informer sur les technologies et futurs usages liés au gaming. LE HACKATHON GAMING : Le Hackathon en quelques chiffres, c\'est 100 participants répartis en équipes de 4 maximum, 24h de compétition, 10 minutes pour convaincre et 1 équipe gagnante ! Leur mission : concevoir un concept de jeu (web et/ou mobile) inspiré de la culture marocaine, développer les scénarios d\'interactions et illustrer l\'univers graphique du jeu en 24h Les gagnants du concours ont remporté une aide financière de 100 000 dh pour le concept et un partenariat avec inwi pour développer le projet. Pour plus d’infos : http://inwidays.ma/content/edition-2013</p>','0000-00-00 00:00:00','undefined','1508858038.png','2013-10-26 09:00:00','2013-10-27 18:00:00','2017-09-10 22:33:09','2017-12-27 10:41:36','Challenge','Nom de projet','Nom de projet','Facultatif','Désactivé','Logo du projet','Logo du projet','Facultatif','Désactivé','Nom de l’entité','Nom de l’entité','Facultatif','Désactivé','Statut juridique','Statut juridique','Facultatif','Désactivé','Logo entité','Logo entité','Facultatif','Désactivé','Plein temps OU partiel','Plein temps OU partiel','Facultatif','Désactivé','Nombre de co-équipiers','Nombre de co-équipiers','Facultatif','Désactivé','Nombre d’années d’expérience','Nombre d’années d’expérience','Facultatif','Désactivé','Expériences et prix','Expériences et prix','Facultatif','Désactivé','Présentez l’idée du projet','Présentez l’idée du projet','Facultatif','Désactivé','Décrivez le concept du projet et ce que vous offrez comme produit/service.','Décrivez le concept du projet et ce que vous offrez comme produit/service.','Facultatif','Désactivé','Présentez votre équipe','Présentez votre équipe','Facultatif','Désactivé','Qu’offrez-vous de mieux que vos concurrents?','Qu’offrez-vous de mieux que vos concurrents?','Facultatif','Désactivé','A qui s’adresse