nous votre dream team','Ce qui rend votre projet unique ?','A qui s’adresse votre projet ?','Pensez-vous détenir le meilleur projet ?','Désactivé',5,'1505082790.jpg','images/videos','Facultatif','Désactivé',0,'Question 1','Question 1','','','Question 2','Question 2','','','Question 3','Question 3','',''),(8,'inwi DAYS 2015','<p>Une journée ouverte à tous, regroupant des experts internationaux et des représentants d\'entreprises innovantes, pour échanger autour des smart cities, de leur utilisation et de leur place dans le quotidien. Pour cette quatrième édition, l\'événement s\'est déroulé le 04 février 2016, à Casablanca et était axé autour des smart cities. DES CONFERENCES Des conférences et débats pour les personnes curieuses d\'en apprendre plus à propos des smart cities. La possibilité de s\'informer sur les technologies du futur et leurs nouveaux usages, en participant aux conférences et débats ouverts à tous et gratuits (sur inscription). Ces conférences étaient l\'opportunité de rencontrer et d\'échanger avec des acteurs internationaux ! DES PROJETS Les inwi DAYS 2015 c’était également un concours pour récompenser le meilleur projet autour des des smart cities ! Découvrez les projets des participants et ceux sélectionnés pour le concours qui s\'est tenu le 04 février 2016 à Casablanca ! Pour plus d\'infos, rendez-vous sur : http://inwidays.ma/content/edition-2015</p>','0000-00-00 00:00:00','undefined','1508858058.png','2015-02-04 09:00:00','2015-02-04 18:00:00','2017-09-11 08:25:19','2017-12-27 10:41:48','Challenge','Nom de projet','Nom de projet','Facultatif','Désactivé','Logo du projet','Logo du projet','Facultatif','Désactivé','Nom de l’entité','Nom de l’entité','Facultatif','Désactivé','Statut juridique','Statut juridique','Facultatif','Désactivé','Logo entité','Logo entité','Facultatif','Désactivé','Plein temps OU partiel','Plein temps OU partiel','Facultatif','Désactivé','Nombre de co-équipiers','Nombre de co-équipiers','Facultatif','Désactivé','Nombre