. Pendant 6 jours, les entrepreneurs sélectionnés bénéficieront de formations, d\'ateliers de travail et de coaching pour challenger et structurer leurs projets. A la clé, pour les 8 meilleurs projets, l’occasion de pitcher devant le jury inwi Days en Janvier 2017, et pour les 2 gagnants inwidays, un soutien financier et l’intégration du programme d’incubation de NUMA Casablanca.</p>','0000-00-00 00:00:00','undefined','1511276881.jpg','2016-01-12 09:00:00','2016-01-12 18:00:00','2017-09-11 08:49:17','2017-12-27 10:41:55','Challenge','Nom de projet','Nom de projet','Facultatif','Désactivé','Logo du projet','Logo du projet','Facultatif','Désactivé','Nom de l’entité','Nom de l’entité','Facultatif','Désactivé','Statut juridique','Statut juridique','Facultatif','Désactivé','Logo entité','Logo entité','Facultatif','Désactivé','Plein temps OU partiel','Plein temps OU partiel','Facultatif','Désactivé','Nombre de co-équipiers','Nombre de co-équipiers','Facultatif','Désactivé','Nombre d’années d’expérience','Nombre d’années d’expérience','Facultatif','Désactivé','Expériences et prix','Expériences et prix','Facultatif','Désactivé','Présentez l’idée du projet','Présentez l’idée du projet','Facultatif','Désactivé','Décrivez le concept du projet et ce que vous offrez comme produit/service.','Décrivez le concept du projet et ce que vous offrez comme produit/service.','Facultatif','Désactivé','Présentez votre équipe','Présentez votre équipe','Facultatif','Désactivé','Qu’offrez-vous de mieux que vos concurrents?','Qu’offrez-vous de mieux que vos concurrents?','Facultatif','Désactivé','A qui s’adresse le projet?','A qui s’adresse le projet?','Facultatif','Désactivé','Finalement : Pensez-vous avoir le meilleur projet? Pourquoi?','Finalement : Pensez-vous avoir le meilleur projet? Pourquoi?','Facultatif','Désactivé','Pièce jointe ( un/plusieurs documents )Business plan, prototypes ou prix remportés','Pièce jointe ( un/plusieurs documents )Business plan, prototypes ou prix remportés','F