ojets retenues.</p><p><br></p><p>Quatre projets se sont distingués et ont bénéficié de différents prix offerts par inwi, <strong>Microsoft</strong> et <strong>LaFactory</strong>.</p><p><br></p><p>De son côté, inwi a remis un pack mifi à chaque membre des groupes finalistes.</p><p>Microsoft a offert 9000 $ de cloud au premier groupe.</p><p>Quant à <strong>LaFactory by ScreenDy</strong>, celle-ci offrira son expertise en accompagnement et mentoring et incubera ces 4 projets afin de mener à bien leurs idées.</p>','0000-00-00 00:00:00','undefined','1507806209.jpg','2018-09-18 19:16:00','2018-09-21 19:16:00','2017-09-23 18:18:45','2019-07-19 14:02:56','Challenge','Nom de projet','Nom de projet','Obligatoire','Activé','Logo du projet','Logo du projet','Obligatoire','Activé','Nom de l’entité','Nom de l’entité','Obligatoire','Activé','Statut juridique','Statut juridique','Obligatoire','Activé','Logo entité','Logo entité','Obligatoire','Activé','Plein temps OU partiel','Plein temps OU partiel','Obligatoire','Activé','Nombre de co-équipiers','Nombre de co-équipiers','Obligatoire','Activé','Nombre d’années d’expérience','Nombre d’années d’expérience','Obligatoire','Activé','Expériences et prix','Expériences et prix','Obligatoire','Activé','Présentez l’idée du projet','Présentez l’idée du projet','Obligatoire','Activé','Décrivez le concept du projet et ce que vous offrez comme produit/service.','Décrivez le concept du projet et ce que vous offrez comme produit/service.','Obligatoire','Activé','Présentez votre équipe','Présentez votre équipe','Obligatoire','Activé','Qu’offrez-vous de mieux que vos concurrents?','Qu’offrez-vous de mieux que vos concurrents?','Obligatoire','Activé','A qui s’adresse le projet?','A qui s’adresse le projet?','Obligatoire','Activé','Finalement : Pensez-vous avoir le meilleur projet? Pourquoi?','Finalement : Pensez-vous avoir le meilleur projet? Pourquoi?','Obligatoire','Activé','Pièce jointe ( un/plusieurs documents )Business plan, prototypes ou prix 