mp 2017','<p>Impact Camp est un programme intensif de sensibilisation aux opportunités de l\'entrepreneuriat à fort impact social et environnemental, et de formation aux outils et méthodologies de l\'entrepreneuriat.</p><p><br></p><p>Pendant 1 semaine, les participants sont challengés pour structurer et développer leurs idées de projets grâce à des formations, du coaching personnalisé et des interventions d\'expert.</p><p><br></p><p>Pour la 3ème édition de l\'<strong>Impact Camp</strong>, <strong>NUMA Casablanca</strong> et<strong> inwi </strong>se sont associés afin d\'identifier et d\'accompagner des projets innovants et à fort potentiel dans l\'éducation.</p><p><br></p><p>Les 8 meilleurs projets ont été sélectionnés pour participer aux inwi days en Janvier 2018. Les 2 projets gagnants des inwi days bénéficieront d\'un support financier de 50.000 dhs par projet et d\'une incubation de 6 mois chez <strong>NUMA Casablanca</strong>.</p>','0000-00-00 00:00:00','undefined','1509630098.JPG','2017-10-01 11:57:00','2017-10-07 11:57:00','2017-11-02 11:59:06','2017-12-27 10:42:23','Challenge','Nom de projet','Nom de projet','Facultatif','Désactivé','Logo du projet','Logo du projet','Facultatif','Désactivé','Nom de l’entité','Nom de l’entité','Facultatif','Désactivé','Statut juridique','Statut juridique','Facultatif','Désactivé','Logo entité','Logo entité','Facultatif','Désactivé','Plein temps OU partiel','Plein temps OU partiel','Facultatif','Désactivé','Nombre de co-équipiers','Nombre de co-équipiers','Facultatif','Désactivé','Nombre d’années d’expérience','Nombre d’années d’expérience','Facultatif','Désactivé','Expériences et prix','Expériences et prix','Facultatif','Désactivé','Présentez l’idée du projet','Présentez l’idée du projet','Facultatif','Désactivé','Décrivez le concept du projet et ce que vous offrez comme produit/service.','Décrivez le concept du projet et ce que vous offrez comme produit/service.','Facultatif','Désactivé','Présentez votre équipe','Présentez votre équipe','Facultatif','Désactivé','Qu’offrez-vous de mieux que vos concurrents?','Qu’offrez-vous de mieux que vos concurrents?','Facultatif','Désactivé','A qui s’adresse le projet?','A qui s’adresse le projet?','Facultatif','Désactivé','Finalement : Pensez-vous avoir le meilleur projet? Pourquoi?','Finalement : Pensez-vous avoir le meilleur projet? Pourquoi?','Facultatif','Désactivé','Pièce jointe ( un/plusieurs documents )Business plan, prototypes ou prix remportés','Pièce jointe ( un/plusieurs documents )Business plan, prototypes ou prix remportés','Facultatif','Désactivé','Vidéo de la participation','Vidéo de la participation','Facultatif','Désactivé','Lien vers RS ou portfolio en ligne (possibilité de rajouter jusqu’à 3)','Lien vers RS ou portfolio en ligne (possibilité de rajouter jusqu’à 3)','Facultatif','Désactivé','description/motivation','description/motivation','Facultatif','Désactivé','Parlez-nous de votre projet','Présentez-nous votre dream team','Ce qui rend votre projet unique ?','A qui s’adresse votre projet ?','Pensez-vous détenir le meilleur projet ?','Désactivé',1,'','','Facultatif','Désactivé',0,'Question 1','Question 1','','','Question 2','Question 2','','','Question 3','Question 3','',''),(24,'Data city','<p><strong>inwi</strong> s’est allié à <strong>Numa Casablanca</strong> dans le cadre de <strong>#DataCity</strong>, un programme d’innovation ouverte inédit au Maroc.</p><p><br></p><p><strong>Data City </strong>est un programme collaboratif destiné à produire / élaborer des solutions pour les Entreprises partenaires en les ouvrant à leur écosystème&nbsp;: Etudiants, Startups, Autorités, Autres Entreprises…</p><p><br></p><p><strong>#DataCity</strong> fait ainsi collaborer de grandes entreprises avec&nbsp;des start-ups, des porteurs de projets et les autorités de la ville afin de développer des solutions innovantes pour la ville intelligente de demain ou Smart City.</p><p><br></p><p>Pour sa première édition, <strong>#DataCity</strong> Casablanca réunit 6 partenaires, incluant la ville de Casablanca&nbsp;: inwi, RATP DEV, LafargeHolcim, Lydec et Michelin.</p><p><br></p><p>Deux thématiques principales ont été proposées aux entrepreneurs et aux porteurs de projet. Ils concernent l’efficacité énergétique de la mobilité et l’empreinte environnementale des bâtiments.</p><p><br></p><p>inwi a défini un challenge relatif à son client MedZsourcing (client de OTEO gérant les zones d’offshoring) et portant sur la transformation de leurs bâtiments Casanearshore en Bâtiments intelligents afin de mesurer et optimiser la consommation énergétique des bâtiments,</p><p><br></p><p>Après une phase de cadrage du challenge, NUMA a lancé un appel à candidatures afin de sélectionner les porteurs de solutions.</p>','0000-00-00 00:00:00','undefined','1509625431.JPG','2016-10-01 12:10:00','2016-10-01 12:10:00','2017-11-02 12:23:51','2017-12-27 10:41:24','Challenge','Nom de projet','Nom de projet','Facultatif','Désactivé','Logo du projet','Logo du projet','Facultatif','Désactivé','Nom de l’entité','Nom de l’entité','Facultatif','Désactivé','Statut juridique','Statut juridique','Facultatif','Désactivé','Logo entité','Logo entité','Facultatif','Désactivé','Plein temps OU partiel','Plein temps OU partiel','Facultatif','Désactivé','Nombre de co-équipiers','Nombre de co-équipiers','Facultatif','Désactivé','Nombre d’années d’expérience','Nombre d’années d’expérience','Facultatif','Désactivé','Expériences et prix','Expériences et prix','Facultatif','Désactivé','Présentez l’idée du projet','Présentez l’idée du projet','Facultatif','Désactivé','Décrivez le concept du projet et ce que vous offrez comme produit/service.','Décrivez le concept du projet et ce que vous offrez comme produit/service.','Facultatif','Désactivé','Présentez votre équipe','Présentez votre équipe','Facultatif','Désactivé','Qu’offrez-vous de mieux que vos concurrents?','Qu’offrez-vous de mieux que vos concurrents?','Facultatif','Désactivé','A qui s’adresse le projet?','