 niveau des boutiques <strong>inwi</strong>.</p>','0000-00-00 00:00:00','undefined','1509626914.JPG','2017-05-06 12:43:00','2017-05-07 12:43:00','2017-11-02 12:48:34','2017-12-27 10:41:19','Challenge','Nom de projet','Nom de projet','Facultatif','Désactivé','Logo du projet','Logo du projet','Facultatif','Désactivé','Nom de l’entité','Nom de l’entité','Facultatif','Désactivé','Statut juridique','Statut juridique','Facultatif','Désactivé','Logo entité','Logo entité','Facultatif','Désactivé','Plein temps OU partiel','Plein temps OU partiel','Facultatif','Désactivé','Nombre de co-équipiers','Nombre de co-équipiers','Facultatif','Désactivé','Nombre d’années d’expérience','Nombre d’années d’expérience','Facultatif','Désactivé','Expériences et prix','Expériences et prix','Facultatif','Désactivé','Présentez l’idée du projet','Présentez l’idée du projet','Facultatif','Désactivé','Décrivez le concept du projet et ce que vous offrez comme produit/service.','Décrivez le concept du projet et ce que vous offrez comme produit/service.','Facultatif','Désactivé','Présentez votre équipe','Présentez votre équipe','Facultatif','Désactivé','Qu’offrez-vous de mieux que vos concurrents?','Qu’offrez-vous de mieux que vos concurrents?','Facultatif','Désactivé','A qui s’adresse le projet?','A qui s’adresse le projet?','Facultatif','Désactivé','Finalement : Pensez-vous avoir le meilleur projet? Pourquoi?','Finalement : Pensez-vous avoir le meilleur projet? Pourquoi?','Facultatif','Désactivé','Pièce jointe ( un/plusieurs documents )Business plan, prototypes ou prix remportés','Pièce jointe ( un/plusieurs documents )Business plan, prototypes ou prix remportés','Facultatif','Désactivé','Vidéo de la participation','Vidéo de la participation','Facultatif','Désactivé','Lien vers RS ou portfolio en ligne (possibilité de rajouter jusqu’à 3)','Lien vers RS ou portfolio en ligne (possibilité de rajouter jusqu’à 3)','Facultatif','Désactivé','description/motivation','description/motivation','Facultatif',