n.',1,1,0,1,0,0,0,1,1,0,0,0,0,'Félicitations',' Votre projet a bien été enregistré. Si vous êtes sûr de vos réponses, vous pouvez soumettre définitivement votre candidature pour qu’elle soit traitée','Vous avez toujours la possibilité de\n                modifier vos réponses avant de les soumettre, en accédant directement à votre candidature','Veuillez choisir une image de 180 px x 230 px','Le fichier doit être de type pdf ou docx et ne doit pas dépasser ','La taille de la vidéo ne doit pas dépasser 5 mins. Il vous suffit d\'uploader votre vidéo sur YouTube et insérer le lien URL','Le fichier doit être de type (pdf ou docx ou png ou jpg ou jpeg) et ne doit pas dépasser ','L\'image est obligatoire'),(21,'اكتشف إمكانيات التعامل مع INWI!','<p>هل تمثل مقاولة ناشئة أو تقوم بتطوير حلول مبتكرة؟</p><p><br></p><p>اكتشف إمكانات التعامل مع inwi!</p><p>inwi&nbsp;فاعل مركزي في التحول الرقمي في المغرب. مهمتنا هي إعطاء رواد الأعمال، الأدوات اللازمة لنجاحهم وتطورهم. منذ عدة سنوات ، انخرطنا في برنامج طموح لدعم النظام البيئي لريادة الأعمال وتشجيع ريادة الأعمال ، والتي تحقق الآن نتائج ملموسة</p><p>انطلاقًا من هذا الالتزام ، تسعى inwi إلى التعاون مع المقاولات الناشئة المبتكرة التي تقدم حلولًا رقمية ذات قيمة مضافة عالية. يجب أن تقدم هذه المقاولات الناشئة الحلول ذات الصلة ، والتي تسمح بحل المشكلات التشغيلية ، لخدمة ملايين المغاربة معًا بشكل أفضل.</p><p class=\"ql-align-right\"><br></p>','0000-00-00 00:00:00','/1635152202.jpg','2021-10-18 09:53:00','2021-11-24 09:53:00','2021-10-25 07:56:41','2021-10-25 08:47:55','النسب','النسب','اسم','اسم','Date de naissance','Date de naissance','Fonction','Fonction','Organisme','Organisme','مدينة','مدينة','Pays de résidence','بلد','اسم','اسم','عنوان','عنوان','Stade de maturité','Stade de maturité','عدد المؤسسين','Quel est le nombre de vos collaborateurs internes?','Site internet','Site internet','CV équipes','CV équipes','Insérez une petite description de votre Startup','Insérez une petite description de votre Startup','','Insérez une vidéo d’une minu