/p><p>inwiDAYS, l’événement annuel incontournable de l\'entrepreneuriat innovant et des startups au Maroc, revient pour sa 12ème édition le 25 juin à Benguerir sous le thème de la « Sport-tech&nbsp;», en partenariat avec l’université Mohammed VI à travers son Fonds d’investissement UM6P Ventures.</p><p><br></p><p>Lors de cette édition, plusieurs panels de discussion seront organisés pour échanger autour de thématiques clés telles que :</p><p>-&nbsp;<strong>L’usage de la data et de l’IA dans le football moderne :</strong>&nbsp;Comment les données et l\'intelligence artificielle révolutionnent le jeu.</p><p>-&nbsp;<strong>La technologie au service de la santé et de la performance des joueurs :&nbsp;</strong>Des innovations pour améliorer la condition physique et les performances des athlètes.</p><p><strong>- La technologie au service de la « fans experience » :</strong>&nbsp;Création d\'une expérience immersive et connectée pour les supporters.</p><p><img src=\"data:image/jpeg;base64,\"></p>','0000-00-00 00:00:00','','2024-06-07 16:54:00','2024-06-28 16:54:00','2024-06-07 21:25:25','2024-06-07 22:09:59','Nom','Nom','Prénom','Prénom','Date de naissance','Date de naissance','Fonction','Fonction','Organisme','Organisme','Ville de résidence','Ville de résidence','Pays de résidence','Pays de résidence','Nom de la Startup','Nom de la Startup','Adresse du siège social','Adresse du siège social','Stade de maturité','Stade de maturité','Nombre de fondateurs','Quel est le nombre de vos collaborateurs internes?','Site internet','Site internet','CV équipes','CV équipes','Insérez une petite description de votre Startup','Insérez une petite description de votre Startup','','Insérez une vidéo d’une minute de votre Startup','Décrivez le problème dont souffrent vos utilisateurs et que vous essayez de résoudre','Décrivez le problème dont souffrent vos utilisateurs et que vous essayez de résoudre','Décrivez votre solution, et expliquez en quoi elle est innovante','Décrivez votre solutio