INSERT INTO `emissions` VALUES (1,'STARTUP: شكون يستثمر فمشروعي؟','Le 1er techshow dédié aux Startups et aux entrepreneurs du digital','inwi, en partenariat avec 2M, lance « Startup », le 1er techshow africain de confrontation en prime time de Startups et des investisseurs !  \n\n« Startup » repose sur un concept simple : elle permet de réunir, lors de chaque prime, les fondateurs d’une Startup avec 5 investisseurs privés marocains qui incarnent le dynamisme et la créativité Marocaine. Entrepreneurs et gestionnaires d’entreprises à succès, ces « Business Angels » donneront une chance aux nouveaux talents et seront prêts à investir de l’argent, du temps et des compétences dans les startups prometteuses.\n\nEn tout, 6 primes de « Startup » seront diffusées sur 2M à partir du 24 novembre 2020 et jusqu’au 29 décembre. Les coulisses de sélection des 24 candidats en lice ainsi que les étapes de leur préparation aux primes sont à découvrir dès le 20 octobre prochain à travers des capsules quotidiennes diffusées sur 2M.','','','https://youtu.be/LhLxTot0wEA','yala_1635353499.jpg','image','Saison 1 - 2020',1,'Primes','Revivez les primes d\'investissement et découvrez les startups ayant canvaincu les business angels dès le 24 novembre 2020',1,'Tous les primes',1,'Startups participantes',1,'Découvrir',1,'découvrez les coulisses de sélection des candidats et leur préparation aux primes à partir du 21 Octobre 2020','',1,'Toutes les capsules',1,'Investisseurs',1,'Les Entrepreneurs',1,'Galerie',1,'Fonds levés par primes','Découvrez le montant global levé par nos startups dès le 24 novembre 2020',1,'2021-10-27 15:41:05','2021-11-01 09:12:48'),(2,'شكون غادي إستتمر في مشروعي ؟ Spécial Startups','Le techshow qui ouvre de nouveaux horizons aux startups marocaines','Une fois de plus, inwi, et en partenariat avec 2M, revient avec une nouvelle saison, pour donner la chance à de nouveaux entrepreneurs d\'ouvrir de nouvelles perspectives à leurs projets.\n\n24 entrepreneurs seront au RDV pour défendre leurs projets devants une dixaine de Business Angels, pour prendre leurs envols.\n\n','Nos entrepreneurs sauront-ils convaincre les Business Angels','Suivez chaque jour pour découvrir les coulisses de l\'émission et on se donne Rendez-vous à partir du 30 novembre pour le premier prime et découvrir nos 4 premiers entrepreneurs.','','Tecshow-851x310_1635857634.jpg','image','Saison 2 - 2022',1,'PRIMES','revivez les primes d\'investissement et découvrez les startups ayant canvaincu les business angels dès le 30 novembre 2020',1,'Tous les primes',1,'STARTUPS PARTICIPANTES',1,'découvrir',1,'DÉCOUVREZ LES COULISSES DE L\'ÉMISSION ','',1,'Toutes les capsules',1,'INVESTISSEURS',1,'LES ENTREPRENEURS',1,'Galerie',0,'FONDS LEVÉS AU TOTAL','DÉCOUVREZ LE MONTANT GLOBAL LEVÉ PAR NOS STARTUPS',1,'2021-11-01 09:08:01','2021-11-02 11:59:41');
/*!40000 ALTER TABLE `emissions` ENABLE KEYS */;
UNLOCK TABLES;

