INSERT INTO `events` VALUES (6,'INJAZ Al-Maghrib Compétition Nationale 2016','<p>Créée en 2007 à l’initiative du <strong>Groupe SN</strong>I, <strong>INJAZ Al-Maghrib</strong> est une association reconnue d’utilité publique qui a pour mission de stimuler l’esprit d’initiative des jeunes et de développer leurs compétences entrepreneuriales à travers l’implication de l’entreprise</p><p>dans l’enseignement public. Des cadres d’entreprise bénévoles dispensent dans les établissements d’enseignement publics, les programmes de formation à entrepreneuriat de Junior <strong>Achievement Worldwide</strong>, leader mondial en matière d’éducation à l’entrepreneuriat depuis 1919. 9 programmes de formation à l’entrepreneuriat sont dispensés selon la méthode de l’apprentissage par l’action par des cadres d’entreprise bénévoles à raison de 2 heures par semaine pendant quelques semaines. Destinés aux collégiens, lycéens et étudiants universitaires, ces programmes ciblent deux axes majeurs : l’éducation à l’entrepreneuriat et l’accompagnement des porteurs de projet.</p><p><br></p><p><strong>Company Program</strong></p><p>Conçu par Junior Achievement et adapté au contexte marocain par INJAZ Al-Maghrib, Company Program est un programme de création et de gestion d’entreprises par des lycéens et des étudiants.</p><p>Durant 16 séances hebdomadaires de 2h, le cadre d’entreprise, qui dispense cette formation bénévolement, aborde avec ses élèves tout le cycle de vie d’une entreprise : création de l’identité visuelle, conception du produit ou service, étude de faisabilité, business plan, placement des actions de la société, production, commercialisation et liquidation de l’entreprise à la fin de l’année scolaire.</p><p><br></p><p><strong>Une célébration universelle</strong></p><p><span style=\"color: black;\">A la fin de la formation au Company Program, une compétition de la Meilleure Junior</span></p><p><span style=\"color: black;\">Entreprise de l’année est organisée dans chaque ville pour célébrer l’accomplissement</span></p><p><span style=\"color: black;\">des efforts des jeunes. Les vainqueurs de ces compétitions régionales participent ensuite à la finale nationale à Casablanca qui désigne les Junior Entreprises lauréates, dans les catégories lycée et université. Enfin, ces champions nationaux partent défendre les couleurs du Maroc lors de la compétition arabe regroupant toutes les Junior Entreprises finalistes des pays membres du réseau INJAZ Al-Arab.</span></p><p>&nbsp;</p><p><strong>La compétition nationale de la meilleure Junior Entreprise 2016</strong></p><p>Organisée à Casablanca, la finale nationale regroupe les vainqueurs des compétitions régionales. Au total, 19 Junior Entreprises ont concouru pour le prix de la Meilleure Junior</p><p>Entreprise de l’année dans deux catégories distinctes : lycée et université.</p><p><br></p><p>Le prix i-Tech de inwi a été décerné à&nbsp;<strong>FINE BUS du lycée Zerktouni d’Agadir</strong>, encadrée par M. El Yousoufi d’Inwi et M. Makroum –&nbsp;<em>conception d’une application de localisation des arrêts de bus pour les passagers.&nbsp;</em></p>','1511277857.jpg','2017-10-06 14:17:02','2020-01-24 09:10:33',29,1,1,'','',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,0,0,''),(50,'MIT Enterprise Forum Arab Startup','<p>Cinq start-up marocaines ont participé à la finale du <strong>MIT Enterprise Forum Arab Startup</strong> Competition. Les cinq entreprises sont en effet les finalistes choisies au terme d’un appel à candidatures lancé par le MIT Entreprise Forum Pan Arab, suite à leur escale au Maroc chez inwi.</p><p><br></p><p>Il s’agit de <strong>Farasha Systems</strong>, <strong>Eco-Heat</strong>, <strong>Eko-Geste Dari</strong>, <strong>Evaptainers</strong> et <strong>Watech</strong>.</p><p><br></p><p>Les cinq start-up sélectionnées ont participé d’abord à un bootcamp en Egypte ou en Jordanie&nbsp;durant les mois de février et mars 2017. Ils&nbsp;ont bénéficié de formations et de coaching en matière d’entrepreneuriat. La compétition finale se tiendra, elle, au Bahrein du 24 au 27 Avril.</p><p><br></p><p>Le MIT Entreprise Forum Arab Startup Competition, en partenariat avec la communauté <strong>Jameel</strong> et l’opérateur Télécoms international <strong>Zain</strong>, est le rendez-vous incontournable pour<strong> </strong>primer l’innovation et encourager l’entrepreneuriat dans la région MENA.&nbsp;</p>','1576744693.png','2017-10-06 15:52:30','2020-01-24 09:43:38',41,0,1,'','',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,0,0,''),(51,'inwi Days 2018','<h3><span style=\"color: rgb(51, 51, 51);\">Pour sa sixième édition, inwi DAYS revient en janvier 2018 autour de la thématique&nbsp;</span><strong style=\"color: rgb(51, 51, 51);\">\"le numérique au service de l\'éducation\"</strong></h3>','1509464294.jpg','2017-10-06 16:08:35','2021-02-12 13:55:08',510,1,1,'','',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,0,0,''),(53,'Maroc Web Awards','<p>inwi continue d’accompagner l’écosystème digital marocain à travers son partenariat officiel de la 10<sup>ème</sup> édition des Maroc Web Awards (MWA). inwi affirme ainsi son engagement à accompagner les jeunes talents du web marocains. Pour sa dixième édition, les maroc web awards se transforment en un festival qui s’étalera sur toute une journée – le dimanche 2 avril. Au menu, des séances de dédicaces par une belle brochette de stars du web, des ateliers animés, des rencontres et des débats. Le tout, dans une ambiance jeune et décontractée. Pas moins de 3000 personnes ont assisté à cette journée. En dix ans, Maroc Web Awards s’est imposé comme l’une des manifestations les plus importantes de la scène digitale marocaine. En plus de récompenser les talents de l’année en matière de production et de diffusion digitale, MWA est un moment privilégié de rencontres et d’échanges entre celles et ceux qui font, au quotidien, le web marocain et leurs communautés. Plusieurs moments forts ont rythmé la dixième édition des Maroc Web Awards&nbsp;: deux panels ont permis aux participants de débattre avec des experts du web marocains de sujets d’actualité comme «Millions de followers, quelle responsabilité ?». Quatre ateliers de formation étaient également prévus avec des sessions dédiées à la photographie, au storytelling, à la création vidéo et au blogging lifestyle.</p>','1509655078.jpg','2017-10-12 09:40:19','2020-02-20 10:38:04',82,1,1,'','',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,0,0,''),(54,'Moroccan Game Conferences','<p>Inwi et le collectif Maghreb Game Developpers ont organisé les 15 et 16 Octobre 2016 la <strong>«&nbsp;Maghreb Game Conference&nbsp;»</strong>. Cet événement a réuni des acteurs de référence dans le domaine du Gaming au Maroc, en Algérie et en Tunisie. </p><p>Les finalistes ont alors été appelés à développer leur jeu afin de le présenter dans l’espace <strong>Tech 22 Smart Africa For Change</strong>, tenu en marge de la COP 22 à Marrakech. Le jeu gagnant a été dévoilé pendant la <strong>COP 22</strong> a été proposé sur <a href=\"http://la3bin.inwi.ma/\" target=\"_blank\">La3bine</a>, la plateforme gaming de inwi.</p>','1509662923.jpg','2017-11-01 16:31:27','2020-01-16 12:29:25',9,1,1,'','',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,0,0,''),(55,'DATA CITY - Demo Day','<p>Le Demo Day est une conférence qui célèbre la fin du programme d\'innovation ouverte <strong>#DataCity</strong>.</p><p><br></p><p>Cet événement a été l\'occasion de découvrir les start-ups innovantes qui ont eu l\'opportunité de prototyper des solutions avec les grandes entreprises partenaires de <strong>DataCity</strong>.</p><p><br></p><p>Les entrepreneurs et les représentant de nos partenaires ont pu partager leur expérience au sein du programme <strong>#DataCity</strong> et présenter les résultats de l\'expérimentation.</p><p><br></p><p>En plus de l\'audience de la scène entrepreneuriale nationale, cet événement a réunit les entreprises, les autorités et les médias, parties prenantes essentielles pour la réussite d\'une dynamique de co-construction de la Casablanca de demain.</p>','1509654976.JPG','2017-11-02 13:19:44','2021-04-06 08:51:05',190,1,1,'','',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,0,0,''),(61,'inwi DAY\'s 2020','<p><strong style=\"color: rgb(51, 51, 51);\">Réservez votre place gratuitement pour la 8</strong><sup style=\"color: rgb(51, 51, 51);\"><strong>e</strong></sup><strong style=\"color: rgb(51, 51, 51);\"> édition de inwiDAYS, sous la thématique de l’inclusion Financière</strong></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">Le&nbsp;</span><strong style=\"color: rgb(153, 51, 255);\">6</strong></p><p><strong style=\"color: rgb(153, 51, 255);\">février 2020</strong><span style=\"color: rgb(51, 51, 51);\">&nbsp;se</span></p><p><span style=\"color: rgb(51, 51, 51);\">tiendra la 8</span><sup>e</sup>&nbsp;édition des INWIDAYS à Casablanca pour clôturer le programme africain dédié aux Startups favorisant les technologies autour de l’inclusion financière.</p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">Des plateformes de crowdfunding aux solutions de micro-assurance, wallets et autres innovations inclusives dans le secteur de la finance, la thématique de cette année décrypte le potentiel et les contraintes à lever liées à un secteur prometteur pour le Continent. Des panelistes et speakers de renom, qui débâteront ensemble les réalités et opportunités du secteur, et partageront leurs expertises et retours d’expériences. Cette année connaîtra la participation exceptionnelle de Idriss Aberkane.</span></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">INWIDAYS est aussi le moment de célébrer 6 start-ups issues de 5 pays africains, porteurs d’innovations à découvrir lors de la compétition pour décerner le prix des meilleures startups de l’année. Des prix en numéraire et un accompagnement opérationnel à la clé pour les 2 meilleures start-ups retenues par les membres du jury. Un troisième prix, \"Prix du Public\", permettra à une troisième start-up de profiter de l\'univers digital&nbsp;</span><strong>by inwi</strong>&nbsp;pour propulser sa solution.</p><p><br></p><p><em style=\"color: rgb(51, 51, 51);\">Réservez sans plus tarder votre place gratuitement&nbsp;!</em></p><p><em style=\"color: rgb(51, 51, 51);\">Places prioritaires aux clients inwi.</em></p>','1587403842.jpg','2020-01-08 15:20:17','2023-02-27 09:36:20',397,1,1,'null','null',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,0,0,NULL),(65,'Les initiatives « Tech & Digital » qui luttent con','<p><span style=\"color: rgb(34, 34, 34);\">Les initiatives «&nbsp;Tech &amp; Digital&nbsp;» qui luttent contre le COVID-19 au Maroc</span></p>','1587565290.png','2020-04-22 14:21:30','2021-09-03 16:11:22',125,1,0,'','',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,0,0,''),(71,'test','<p>test</p>','1613164158.PNG','2021-02-12 20:09:18','2021-02-12 20:40:56',1,1,0,'','',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,0,0,''),(72,'test1','<p>test1</p>','1727256654.webp','2021-02-12 20:43:24','2024-09-25 10:30:54',1,1,0,'null','null',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,0,0,NULL),(73,'inwi Days 2021','<p><strong>Inscrivez-vous gratuitement pour suivre en live la 9e&nbsp;édition de inwiDAYS, sous le thème de la relance économique via l’innovation, le 25 et 26 février 2021.</strong></p><p class=\"ql-align-center\">&nbsp;</p><p>2020 était une année exceptionnelle qui a mis en exergue l’apport des jeunes entreprises innovantes dans la réinvention de métiers et de services adaptés au contexte sanitaire actuel.</p><p>&nbsp;</p><p>Pour sa 9e&nbsp;édition qui aura lieu&nbsp;<strong>le 25 et 26 février 2021</strong>, inwiDAYS sera l’occasion de découvrir ces jeunes femmes et hommes qui travaillent dans le secteur des startups au Maroc et connaître leurs avis sur le futur du secteur de l’entrepreneuriat et de l’innovation dans la relance de la dynamique économique post-covid au Maroc.</p><p>&nbsp;</p><p>inwiDAYS est aussi le moment de célébrer 3 startups, porteurs d’innovations à découvrir lors de la deuxième journée pour décerner le prix des meilleurs startups de l’année. Ces prix permettront à ces startups de profiter de l’univers digital by inwi pour propulser leurs solutions.</p><p>&nbsp;</p><p>Inscrivez-vous sans plus tarder et découvrons ensemble le futur des startups et leur rôle dans la relance économique&nbsp;!</p>','1631531608.jpg','2021-02-12 20:44:03','2021-09-13 10:13:28',18,1,0,'Revoir le live inwi days 2020','https://www.youtube.com/watch?v=FjfKo-RKWA4&t=10213s',1,'2021-09-01 12:10:38','2021-09-30 12:10:38',1,200,0,'Live'),(77,'émission startup 2','<p>test test</p><p>test test test test test test test test test test test test test test test test test test test test test test vtest test vtest test test test test test test test vvv</p><p>test test test test test test vtest test test test test test vvvvvvtest test vvvvvtest test test test test test test test</p>','1625050110.jpg','2021-06-30 09:47:15','2021-09-09 11:16:34',14,1,0,'null','null',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,0,0,''),(79,'New event startup','<p>New event startupNew event startupNew event startupNew event startupNew event startup</p><p>New event startupNew event startupNew event startup</p><p>New event startupNew event startupNew event startupNew event startupNew event startupNew event startupNew event startupNew event startupNew event startupNew event startupNew event startupNew event startupNew event startupNew event startup</p><p>New event startupNew event startupNew event startupNew event startup</p>','1625656096.jpg','2021-07-07 09:09:34','2021-12-07 08:37:59',0,1,0,'A suivre sur Youtube','https://www.quivainvestirdansmonprojet.ma/',1,'2021-12-22 11:06:00','2021-12-31 11:06:00',1,1200,1,'Live Youtube'),(80,'inwi Days 2021','<p><strong>Inscrivez-vous gratuitement pour suivre en live la 9e&nbsp;édition de inwiDAYS, sous le thème de la relance économique via l’innovation, le 25 et 26 février 2021.</strong></p><p class=\"ql-align-center\">&nbsp;</p><p>2020 était une année exceptionnelle qui a mis en exergue l’apport des jeunes entreprises innovantes dans la réinvention de métiers et de services adaptés au contexte sanitaire actuel.</p><p>&nbsp;</p><p>Pour sa 9e&nbsp;édition qui aura lieu&nbsp;<strong>le 25 et 26 février 2021</strong>, inwiDAYS sera l’occasion de découvrir ces jeunes femmes et hommes qui travaillent dans le secteur des startups au Maroc et connaître leurs avis sur le futur du secteur de l’entrepreneuriat et de l’innovation dans la relance de la dynamique économique post-covid au Maroc.</p><p>&nbsp;</p><p>inwiDAYS est aussi le moment de célébrer 3 startups, porteurs d’innovations à découvrir lors de la deuxième journée pour décerner le prix des meilleurs startups de l’année. Ces prix permettront à ces startups de profiter de l’univers digital by inwi pour propulser leurs solutions.</p><p>&nbsp;</p><p>Inscrivez-vous sans plus tarder et découvrons ensemble le futur des startups et leur rôle dans la relance économique&nbsp;!</p>','1631531794.jpg','2021-09-13 10:16:34','2021-09-16 08:58:02',0,1,0,'Revoir le live 2020','https://www.youtube.com/watch?v=FjfKo-RKWA4&t=10213s',1,'2021-09-01 12:14:00','2021-09-30 12:14:00',1,200,0,'Live'),(82,'INWI DAYS 2021','<p>تسجل مجانًا لمتابعة مباشرةً النسخة التاسعة من inwiDAYS ، تحت موضوع الانتعاش الاقتصادي من خلال الابتكار ، في 25 و 26 فبراير 2021.</p><p>سنة 2020، سنة استثنائية سلط فيها الضوء على مساهمة المقاولات المبتكرة الشابة في إعادة اختراع المهن والخدمات المتوافقة مع سياق جائحة كورونا.</p><p>في نسختها التاسعة ، التي ستقام في 25 و 26 فبراير 2021 ، ستكون inwiDAYS فرصة لاكتشاف هؤلاء الشابات والرجال الذين يعملون في قطاع المقولات الناشئة في المغرب ومعرفة آرائهم حول مستقبل قطاع ريادة الأعمال و الابتكار في إحياء الديناميكيات الاقتصادية ما بعد الجائحة الحالية في المغرب.</p>','1635172791.jpg','2021-10-25 13:39:51','2021-11-24 10:24:07',0,1,0,'تسجل مجانًا','https://rctwebinnov.inwi.ma/programs',1,'2021-11-30 15:34:00','2021-12-01 15:34:00',0,150,0,'تسجل مجانًا'),(83,'final test','<p>final test final test final test final test final test final test</p><p>final test final test final test final test final test</p><p><br></p>','1639651347.webp','2021-12-16 09:42:27','2022-01-06 14:47:02',0,1,0,'Inscription finale','https://www.youtube.com/watch?v=uU3AIBmXF1o',1,'2022-01-31 11:32:00','2022-03-31 11:32:00',1,2000,0,'Live final test'),(84,'La10éme édition des inwiDAYS','<p>L’e-commerce est un secteur en plein essor dans lequel les startups redoublent d’ingéniosité pour développer des solutions innovantes facilitant le développement de l’achat en ligne.</p><p><span style=\"color: rgb(36, 0, 25);\">&nbsp;</span></p><p><span style=\"color: rgb(36, 0, 25);\">Pour sa 10</span><sup style=\"color: rgb(36, 0, 25);\">e</sup><span style=\"color: rgb(36, 0, 25);\">&nbsp;édition qui aura lieu&nbsp;</span><strong style=\"color: rgb(36, 0, 25);\">le 24 et 25 mars 2022</strong><span style=\"color: rgb(36, 0, 25);\">, inwiDAYS sera l’occasion de </span>mettra la lumière sur le futur de l’e-commerce à travers plusieurs tables rondes et keynotes qui vont s\'enchaîner pendant les deux jours et verront la participation de plusieurs experts reconnus, entrepreneurs inspirants et institutionnels qui vont essayer de décrypter les innovations et disruptions susceptibles de façonner le modèle de l\'e-commerce de demain.</p><p><span style=\"color: rgb(36, 0, 25);\">inwiDAYS est aussi le moment de célébrer 3 startups, porteurs d’innovations à découvrir lors de la deuxième journée pour décerner le prix des meilleurs startups de l’année. </span></p><p><span style=\"color: rgb(36, 0, 25);\">Ces prix permettront à ces startups de profiter de l’univers digital by inwi pour propulser leurs solutions.</span></p><p><span style=\"color: rgb(36, 0, 25);\">&nbsp;</span></p><p><em style=\"color: rgb(51, 51, 51);\">Réservez sans plus tarder votre place gratuitement&nbsp;!</em></p>','1706211894.webp','2022-03-07 08:10:21','2024-0