INSERT INTO `programmes` VALUES (2,'test inwi DAY\'s 2020','2020-01-08 07:14:42','2024-06-07 21:35:11','/1706212253.webp','<p><strong>Des aides financières allant jusqu’à 100 000 dhs, promises aux 3 meilleures startups opérant dans la la RetailTECH</strong></p>','2020-01-16 17:18:00',1,0,3,'challenge_2',10,11,NULL,0,''),(10,'test programme emission','2021-01-13 20:14:02','2024-06-07 21:35:11','/1610572442.webp','<p>Texte test programme emission</p><p>test programme emissiontest programme emissiontest programme emission</p><p>test programme emissiontest programme emissiontest programme emissiontest programme emissiontest programme emissiontest programme emissiontest programme emissiontest programme emissiontest programme emissiontest programme emissiontest programme emission</p><p>test programme emissiontest programme emissiontest programme emissiontest programme emissiontest programme emissiontest programme emissiontest programme emissiontest programme emissiontest programme emission</p>','0000-00-00 00:00:00',0,0,4,'',NULL,NULL,NULL,1,'https://inwi-innov.neoxia-maroc.net/emission-startups'),(11,'Explorez le potentiel de collaboration avec inwi !','2021-02-12 13:33:44','2024-06-07 21:35:11','/1630687253.webp','<p><strong style=\"color: rgb(148, 32, 147);\">Vous représentez une Startup, et vous développez des solutions innovantes ?</strong></p><p><strong style=\"color: rgb(148, 32, 147);\">Explorez le potentiel de collaboration avec inwi&nbsp;!</strong></p><p>inwi est un acteur central de la transformation numérique au Maroc. Notre mission est de donner aux entrepreneurs, présents et futurs, les outils de leur réussite et de leur développement. Depuis plusieurs années, nous sommes engagés dans un ambitieux programme de soutien à l’écosystème entrepreneurial et d’incitation à l’entreprenariat qui donne aujourd’hui des résultats concrets.</p><p>&nbsp;</p><p>Dans l’esprit de cet engagement, inwi cherche à collaborer avec des startups innovantes proposant des solutions digitales à forte valeur ajoutée. Ces startups doivent proposer des solutions pertinentes, qui permettent de résoudre des problématiques opérationnelles, pour mieux servir ensemble des millions de marocains.</p><p>&nbsp;</p><p>Alors si vous êtes entrepreneurs, ou si vous représentez une startup digitale, et vous souhaitez compter inwi parmi vos clients, il vous suffit de vous inscrire et renseigner les informations relatives à votre solution pour permettre à nos équipes de vous identifier, d’étudier votre solution et de vous connecter aux bonnes opportunités et interlocuteurs internes qui accompagneraient votre démarche de business development.</p>','2021-09-01 14:32:00',1,0,2,'challenge_2',NULL,20,NULL,0,'undefined'),(15,'test evenement','2024-06-07 21:32:48','2024-06-07 21:40:33','/1717776168.webp','<p>test evenementtest evenementtest evenementtest evenement</p>','2024-06-07 17:00:00',0,1,1,'event',NULL,NULL,89,0,'undefined');
