INSERT INTO `questions` VALUES (31,'Comment participer à un évènement ?','<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Connectez-vous sur la plateforme inwi.innov.ma</p><p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Sur le menu à droite, cliquez sur «&nbsp;programmes&nbsp;»</p><p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Dans la rubrique «&nbsp;prochains rendez-vous&nbsp;», choisissez le programme où vous voulez participer.</p><p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Appuyez sur «&nbsp;réserver&nbsp;»</p>',1,1,'2020-03-04 14:06:04','2020-03-05 09:31:51'),(34,'Comment créer un compte sur inwi innov ?','<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Sur le menu à droite, cliquez sur le bouton +.</p><p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Renseignez votre nom, votre prénom et acceptez les conditions générales d’utilisation et la politique de confidentialité (*)</p><p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Cliquez sur «&nbsp;suivant&nbsp;»</p><p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Entrez votre adresse e-mail et votre mot de passe.</p><p>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Cliquez sur&nbsp;«&nbsp;Je m’inscris&nbsp;».</p><p>6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Pour finaliser la création de votre compte, vous devez confirmer votre adresse e-mail.</p><p>&nbsp;* Vous pouvez vous inscrire en utilisant un compte (LinkedIn, Instagram, Facebook, Twitter)</p>',2,1,'2020-03-05 07:53:06','2020-03-05 09:31:10'),(35,'Pourquoi n\'ai-je pas reçu un e-mail de confirmation de participation à un événement ?','<p>Si vous n\'avez pas reçu l’email de confirmation sur votre boite de réception, veuillez consulter votre dossier Courrier indésirable (Spam).</p>',3,1,'2020-03-05 09:32:25','2020-03-05 09:32:25'),(37,'Pourquoi participer aux programmes de inwi innov ?','<p>×&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Booster votre projet innovant,</p><p>×&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Accéder à des partenaires privilégiés,</p><p>×&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Faire partie d’une communauté d’entrepreneurs,</p><p>×&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Bénéficier d’un accompagnement entrepreneurial,</p>',4,1,'2020-03-05 09:33:06','2020-03-05 09:33:06'),(38,'D’autres questions ?','<p>Contactez-nous via le formulaire:</p><p><a href=\"https://innov.inwi.ma/contact\" target=\"_blank\">https://innov.inwi.ma/contact</a></p>',5,1,'2020-03-05 09:34:24','2020-03-06 14:33:32');
/*!40000 ALTER TABLE `questions` ENABLE KEYS */;
