u>Ceci est une introduction </u></em>Ceci est une introduction </strong>Ceci est une introduction <em>Ceci est une introduction </em><u>Ceci est une introduction </u><span style=\"color: rgb(107, 36, 178);\">Ceci est une introduction.</span></p><p class=\"ql-align-justify\"><br></p><pre class=\"ql-syntax ql-align-justify\" spellcheck=\"false\">\"Ceci est une citation\" Julien - PDG de startup\n</pre><p><br></p><ol><li>Point 1</li><li>Point 2</li><li>Point 3</li></ol><p><br></p><ul><li class=\"ql-indent-1\">Bullet point 1</li><li class=\"ql-indent-1\">Bullet point 2</li><li class=\"ql-indent-1\">Bullet point 3</li></ul><p><br></p><p><a href=\"https://innov.inwi.ma/\" target=\"_blank\"><u>Redirection</u></a></p>','','Texte test',16,'2021-09-09 15:14:16','2021-09-09 15:44:23',16,''),(32,'text','<p>Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test</p><p><br></p><p><br></p><p><img src=\"data:image/jpeg;base64,\"></p>','',' ',16,'2021-09-09 15:36:21','2021-09-09 15:40:56',17,''),(33,'text','<ol><li>test 1</li><li>Test 2</li><li>Test 3</li></ol><p><br></p><ul><li class=\"ql-indent-1\">Test a</li><li class=\"ql-indent-1\">test b</li><li class=\"ql-indent-1\">test c</li></ul>','','tirets',16,'2021-09-13 14:52:37','2021-09-13 14:55:48',18,''),(40,'text','<p>لقد حقق الموسم الأول من برنامج \"شكون غادي يستثمر في مشروعي؟ \" نجاحا وشعبية حقيقية لدى الجمهور المغربي، حيث سجل هذا البرنامج، الأول من نوعه في المغرب العربي والمخصص للمقاولات الناشئة، متابعة قياسية طوال مدة بثه. وسجلت برايمات البرنامج مشاهدة قياسية فاقت 3 ملايين مشاهد في كل برايم.&nbsp;</p>','','',19,'2021-10-25 15:03:31','2021-10-25 15:03:31',27,''),(41,'text','<p>وتم إطلاق هذا البرنامج الشامل، المخصص للمقاولات الناشئة، من قبل القناة الثانية وبشراكة مع إنوي. ويجسد التزام الشريكين بتعزيز الاقتصاد الرقمي الجديد ودعم نمو المقاولات المغربية الناشئة.&nbsp;</p><p>وصرح سليم الشيخ، المدير العام لمجموعة \"SOREAD 2M\" قائلا: » نحن سعداء بالاهتمام والإقبال الذي عرفه البرنامج سواء على شاشة التلفزيون أو على المنصات الرقمية. لقد سجلنا نسب مشاهدة قياسية تؤكد الإهتمام الذي يوليه المغاربة للإستثمار والمقاولات ببلادنا. وبصفتنا وسيلة إعلام مواطنة ذات منفعة عامة، كان هدفنا من البرنامج هو المساهمة في خلق ديناميكية مقاولاتية جديدة لدى الشباب وتوفير الوسائل اللازمة للتعريف بمشاريعهم والحصول على مواكبة قيمة. ونتمنى أيضا أن نكون قد أعطينا لشباب آخرين فرصة دخول عالم المقاولات. «</p><p>وعبرت نادية رحيم، مديرة العلامات التجارية والتواصل لدى إنوي قائلة:» نحن فخورون بمواكبة المقاولات الناشئة المغربية ومساهمتنا في التعريف بها لدى العموم عبر هذا البرنامج الذي حقق نتائج إستثنائية على كل المستويات. وبتوالي برايمات البرنامج تم تقديم مشاريع مبتكِرة وذات قيمة مضافة في عدة مجالات. ويواصل إنوي بذلك مواكبته للمقاولات الناشئة المغربية لمساعدتها على تحقيق مشاريعها وتسريع وتيرة نموها. «</p><p>وصرح مهدي علوي، المدير التنفيذي والمؤسس لـ \" LaStartupFactory \" قائلا: » تمكن هذا البرنامج من إدخال مفهوم المقاولات الناشئة إلى كل البيوت المغربية وتحفيز الملايين من الشباب في مجال المقاولات المبتكرة وإعطائهم الأمل والثقة. هذا البرنامج التلفزي هو بمثابة نموذج تفكير جديد تشهده بلادنا. ويعتبر برنامج \"شكون غادي يستثمر في مشروعي؟ \" فرصة ملموسة للتمويل لكل مقاولة ناشئة ومواكبتها من طرف مستثمرين ناجحين. وبانتهاء الموسم الأول من هذا البرنامج سيتم مواصلة مواكبة المقاولين من طرف \" LaStartupFactory\" للحصول على تمويلات لمشاريعهم وتسريع وتيرتها. «&nbsp;</p>','','',19,'2021-10-25 15:03:31','2021-10-25 15:03:41',25,''),(42,'url','https://www.youtube.com/watch?v=qBniSSNaWh4','','دعوة للمشاريع',19,'2021-10-25 15:03:32','2021-10-25 15:03:41',26,''),(45,'image','','rls_img-1639650687-Décli-innovinwi-prime5.webp','final test',27,'2021-12-16 09:31:27','2021-12-16 09:31:27',32,''),(46,'url','https://www.youtube.com/watch?v=uU3AIBmXF1o','','final test ',27,'2021-12-16 09:31:27','2021-12-16 09:31:27',31,'rls_thumb-1639650687-Décli-innovinwi-prime5.webp'),(47,'text','<p>final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test </p>','','final test ',27,'2021-12-16 09:31:27','2021-12-16 09:31:27',30,''),(48,'url','https://www.youtube.com/watch?v=uU3AIBmXF1o','','final test',28,'2021-12-16 09:32:33','2022-04-25 10:42:21',33,'/rls_thumb-1639650753-Décli-innovinwi-prime5.webp'),(49,'text','<p>jdjdjddjdjdjdj</p>','','dsd',28,'2022-04-25 15:44:12','2022-04-25 15:44:12',34,''),(50,'text','<p>Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test Test </p>','','',28,'2022-07-27 14:50:32','2022-07-27 14:50:32',35,'');
