INSERT INTO `releases` VALUES (5,'Maroc Web Awards 2019','<p><strong style=\"color: windowtext;\">Soutenus par inwi, «&nbsp;Maroc Web Awards&nbsp;» diffusés pour la première fois sur 2M.</strong></p>','Communiqué de presse','/1583405965.jpg','2020-03-04 13:10:16','2020-03-05 09:59:40',1,'0000-00-00 00:00:00',0),(6,'Devoxx 2019','<p><strong>Inwi, Partenaire Digital de Devoxx Morocco Inwi, Partenaire Digital de Devoxx Morocco Inwi, Partenaire Digital de Devoxx Morocco Inwi, Partenaire Digital de Devoxx Morocco Inwi, Partenaire Digital de Devoxx Morocco Inwi, Partenaire Digital de Devoxx Morocco Inwi, Partenaire Digital de Devoxx Morocco Inwi, Partenaire Digital de Devoxx Morocco Inwi, Partenaire Digital de Devoxx Morocco Inwi, Partenaire Digital de Devoxx Morocco Inwi, Partenaire Digital de Devoxx Morocco Inwi, Partenaire Digital de Devoxx Morocco </strong></p>','Communiqué de presse','/1583405287.jpg','2020-03-04 14:09:48','2021-04-06 10:31:11',1,'0000-00-00 00:00:00',0),(7,'inwiDAYS 2020','<p><strong>8</strong><sup><strong>ème</strong></sup><strong> édition réussie pour «inwiDAYS&nbsp;»&nbsp;! Grand-messe des startups marocaines et africaines, ce rendez-vous annuel vient couronner l’accompagnement soutenu de inwi, depuis 2012, en faveur de l’entreprenariat innovant. Placé sous le thème de l’inclusion financière, «&nbsp;inwiDAYS&nbsp;» a rassemblé, cette année encore, des participants et speakers de renommée nationale et internationale. Des projets porteurs d’innovations pour l’inclusion financière ont été primés.&nbsp;&nbsp;</strong></p>','Communiqué de presse','1609142418.jpg','2020-03-05 10:10:54','2020-12-28 07:00:18',1,'2020-02-06 10:01:31',0),(8,'Impact Camp 2019','<p><strong>inwi met l’innovation au service de l’inclusion financière lors de l’Impact Camp 2019</strong></p><p><br></p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Une nouvelle édition de l’Impact Camp sous le signe de l’inclusion financière</em></p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Près de 400 candidatures représentant 23 pays et 11 projets sélectionnés pour le bootcamp</em></p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Une semaine pour structurer les différents projets et retenir les 8 finalistes pour le inwiDAYS 2020</em></p>','Communiqué de presse','/1607524095.jpg','2020-03-05 10:16:58','2021-08-31 08:42:40',1,'2020-07-29 14:44:00',1),(9,'Les projets cent pour cent marocains qui luttent contre le Covid 19 pour l\'année 2020','<p>Plusieurs entrepreneurs ont rejoint l’élan de solidarité dès le début du confinement au Maroc pour développer des solutions qui luttent contre la propagation et les effets de la covid19.</p><p>Plusieurs startups digitales ont su faire preuve d’agilité et de créativité pour développer rapidement des solutions adaptées à certains secteurs ou usages dans le contexte sanitaire actuel.</p>','Article','/1607523899.jpg','2020-09-07 14:23:08','2021-08-30 16:44:40',1,'2020-09-07 16:21:51',1),(12,'OK شكون غادي يستثمر في مشروعي ؟','<p>yguzagegdiuzea</p>','Communiqué de presse','/1607524160.jpg','2020-12-07 07:51:08','2021-08-30 16:44:39',1,'2020-12-07 09:51:53',1),(15,'Test article ','<p><span style=\"color: rgb(36, 0, 25);\">Ceci est la description de l\'article testCeci est la description de l\'article testCeci est la description de l\'article testCeci est la description de l\'article testCeci est la description de l\'article testCeci est la description de l\'article testCeci est la description de l\'article testCeci est la description de l\'article test</span></p><pre class=\"ql-syntax\" spellcheck=\"false\">Ceci est la description de l\'article testCeci est la description de l\'article test\n</pre>','Article','/1628502200.jpg','2021-08-09 08:43:20','2021-09-07 08:23:16',1,'2021-08-09 10:40:34',1),(16,'Ceci est un titre pour le test','<h1><strong>Title Heading</strong></h1><h1>Title Heading</h1><p><br></p><h2><strong>Title Subheading</strong></h2><h2>Title Subheading</h2><p><br></p><p><span class=\"ql-font-serif\">Ceci est un texte Serif Ceci est un texte Serif Ceci est un texte Serif</span></p><p><br></p><p>Ceci est un texte Sans serif Ceci est un texte Sans serif Ceci est un texte Sans serif</p><p><br></p><p><span class=\"ql-font-monospace\">Ceci est un texte Monospace Ceci est un texte Monospace Ceci est un texte Monospace</span></p>','Article','/1631203973.jpg','2021-09-09 15:12:53','2021-09-09 15:50:01',1,'2021-09-09 17:12:26',0),(19,'نجاح كبير للموسم الأول من برنامج \"شكون غادي يستثمر في مشروعي؟ ','<p class=\"ql-align-right\">متابعة إستثنائية على شاشة التلفزيون: قرابة 3 ملايين مشاهد، مساء كل ثلاثاء، خلال كل برايم منذ البث الأول، بالإضافة إلى 7 ملايين مشاهد عند عرض ربورطاجات البرنامج.</p><p class=\"ql-align-right\">أرقام قياسية تم تسجيلها على مستوى المنصات الرقمية، إذ وصل نطاق المتأثرين إلى 40 مليون شخصا، ومساهمات قيمة ترجمت الحماس الذي رافق البرنامج.</p><p class=\"ql-align-right\">ل</p>','Article','/1635177811.webp','2021-10-25 15:03:31','2024-10-04 16:52:02',1,'2021-10-24 16:55:09',0),(20,'test version arabe','<p>test version arabetest version arabetest version arabetest version arabe</p>','Article','/1635433097.jpg','2021-10-28 13:58:17','2021-11-24 10:23:35',1,'2021-10-29 15:57:09',0),(27,'final test','<p>final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test </p>','Article','1639650687.webp','2021-12-16 09:31:27','2021-12-16 09:31:27',1,'2021-12-16 11:29:57',0),(28,'final test','<p>final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test final test</p>','Communiqué de presse','170749266