rs, Acquisition, & Business Model\",\"label_needs_expection\":\"Besoins & Attentes\",\"message_soumettre_titre\":\"Félicitations\",\"message_soumettre_contenu\":\"Votre projet a bien été soumis .Nous prendrons contact avec vous très bientôt, dès étude de votre solution.\",\"lastname_active\":\"1\",\"firstname_active\":\"1\",\"birthday_active\":\"1\",\"function_active\":\"1\",\"organisme_active\":\"1\",\"city_active\":\"1\",\"country_active\":\"1\",\"startup_name_active\":\"1\",\"startup_logo_active\":\"1\",\"office_address_active\":\"1\",\"maturity_stage_active\":\"1\",\"avatar_active\":\"1\",\"startup_description_active\":\"1\",\"message_save_titre\":\"Félicitations\",\"message_save_contenu\":\"Bravo, votre projet a bien été créé.Vous pouvez toujours modifier vos informations.Nous vous contacterons bientôt pour l’annonce des résultats de pré-sélection.\"}'),(420,'fr','19','App\\Models\\Challenge2','{\"id\":19,\"title\":\"EXPLOREZ LE POTENTIEL DE COLLABORATION AVEC INWI !\",\"description\":\"<p><strong style=\\\"color: rgb(148, 32, 147);\\\">Vous représentez une Startup, et vous développez des solutions innovantes ?<\\/strong><\\/p><p><strong style=\\\"color: rgb(148, 32, 147);\\\">Explorez le potentiel de collaboration avec inwi&nbsp;!<\\/strong><\\/p><p>inwi est un acteur central de la transformation numérique au Maroc. Notre mission est de donner aux entrepreneurs, présents et futurs, les outils de leur réussite et de leur développement. Depuis plusieurs années, nous sommes engagés dans un ambitieux programme de soutien à l’écosystème entrepreneurial et d’incitation à l’entreprenariat qui donne aujourd’hui des résultats concrets.<\\/p><p>&nbsp;<\\/p><p>Dans l’esprit de cet engagement, inwi cherche à collaborer avec des startups innovantes proposant des solutions digitales à forte valeur ajoutée. Ces startups doivent proposer des solutions pertinentes, qui permettent de résoudre des problématiques opérationnelles, pour mieux servir ensemble des millions de marocains.<\\/p><p>&nbsp;<\\/p><p>Alors si vous êtes entrepreneurs, ou si vous représentez une startup digitale, et vous souhaitez compter inwi parmi vos clients, il vous suffit de vous inscrire et renseigner les informations relatives à votre solution pour permettre à nos équipes de vous identifier, d’étudier votre solution et de vous connecter aux bonnes opportunités et interlocuteurs internes qui accompagneraient votre démarche de business development.<\\/p><p><img src=\\\"data:image\\/png;base64,iVBORw0KGgoAAAANSUhEUgAACHAAAAhwCAYAAABPzFtpAAAACXBIWXMAABYlAAAWJQFJUiTwAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAOu1SURBVHgB7N1NcFX3ecfxB+y8GNFVoXI32BO8MFmYTOqV87KLnSxxdm2c7tJJl6m7SmfsRb0xniYre0hWBS9jseVlBwE2IoO04GqmoInY1BqpaTrRvXZjg6I\\/1zJgY5DEkZ7\\\\/vj\\/fsjZjYe++P90wEAAAAAHSCgAMAAIBtsbwY8fvr4zCjfF5eRQkzlj75\\/IO1nxsO45Htmxx\\/3L\\/+8cnx10rgsW\\/t84m1j089I\\/gAAAAAoF67VtcEAAAAbEFZzihBxsL18atEGusfa1RCjr9+chx6PHUw4sBBcQcAAAAAdRBwAAAAsGElzhjMRNyYH69r3LgenVFijrvDjqcP3ln2AAAAAIDtJuAAAADgvsq6xsK1iMHsJ9HG9WbOnbRJCTpKzHHouXHYcehwAAAAAMC2EHAAAADwqfWFjcsX+xlsPEw5t1KCjr97QdABAAAAQLMEHAAAAD22vrIxfTHit2cEG5tVgo5nD4+Djq8fdnIFAAAAgK0TcAAAAPTMerRx\\/mzE5QuijSaVdY7nX7iz0AEAAAAAGyXgAAAA6IlyGkW0sXP2T0Y8+1zEd190agUAAACAhxNwAAAAdFiJNgazEaenRBuZSszxzRcifvCyMysAAAAA3J+AAwAAoGPKiZRzpyMuXxzHG9Tl0HMR33lxvMwBAAAAAOsEHAAAAB1Rwo1TU9Y22mL9xMoPf2yVAwAAAAABBwAAQOuVMylTJ6xttFlZ5Xjp5YjnXwgAAAAAekrAAQAA0FLCje4pqxxHXnFeBQAAAKCPBBwAAAAtI9zoPiEHAAAAQP8IOAAAAFpCuNE\\/Qg4AAACA\\/hBwAAAAVE64gZADAAAAoPsEHAAAAJUSbvBZQg4AAACA7hJwAAAAVGZ5MeK94xHnzwbc13e+F\\/HDH0fsmwwAAAAAOkLAAQAAUInRMOLUVMTptddwGPBQLx2J+MHLQg4AAACALhBwAAAAVKCcS\\/nVWxFLiwGb4qwKAAAAQDcIOAAAABKV1Y1jb0ZcvhTwSJxVAQAAAGg3AQcAAECS0ycjpo47l0Jz9uyNePmViO8fCQAAAABaRsABAACww5YXI44djRjMBmyLQ89F\\/NO\\/WuMAAAAAaBMBBwAAwA6yusFO2T8ZceSViO++GAAAAAC0gIADAABgB4yGEcfejLh8KWBHvXQk4oc\\/jtgzEQAAAABUTMABAACwzQYzEb96K2JpMSBFWeP4+VtOqgAAAADUTMABAACwjd59J+LUyYAq\\/OinEd8\\/EgAAAABUSMABAACwDZYXI44djRjMBlSlnFR55acBAAAAQGUEHAAAAA1zMoXaHTgY8bPXnVQBAAAAqImAAwAAoEGnT0aceCegevsnI37