sage_soumettre_contenu\":\"Votre projet a bien été soumis .Nous prendrons contact avec vous très bientôt, dès étude de votre solution.\",\"lastname_active\":1,\"firstname_active\":1,\"birthday_active\":0,\"function_active\":1,\"organisme_active\":0,\"city_active\":0,\"country_active\":0,\"startup_name_active\":1,\"startup_logo_active\":1,\"office_address_active\":0,\"maturity_stage_active\":0,\"avatar_active\":0,\"startup_description_active\":0,\"message_save_titre\":\"Félicitations\",\"message_save_contenu\":\"Bravo, votre projet a bien été créé.Vous pouvez toujours modifier vos informations.Nous vous contacterons bientôt pour l’annonce des résultats de pré-sélection.\"}'),(422,'fr','6','App\\Models\\Event','{\"id\":\"6\",\"title\":\"INJAZ Al-Maghrib Compétition Nationale 2016\",\"description\":\"<p>Créée en 2007 à l’initiative du <strong>Groupe SN<\\/strong>I, <strong>INJAZ Al-Maghrib<\\/strong> est une association reconnue d’utilité publique qui a pour mission de stimuler l’esprit d’initiative des jeunes et de développer leurs compétences entrepreneuriales à travers l’implication de l’entreprise<\\/p><p>dans l’enseignement public. Des cadres d’entreprise bénévoles dispensent dans les établissements d’enseignement publics, les programmes de formation à entrepreneuriat de Junior <strong>Achievement Worldwide<\\/strong>, leader mondial en matière d’éducation à l’entrepreneuriat depuis 1919. 9 programmes de formation à l’entrepreneuriat sont dispensés selon la méthode de l’apprentissage par l’action par des cadres d’entreprise bénévoles à raison de 2 heures par semaine pendant quelques semaines. Destinés aux collégiens, lycéens et étudiants universitaires, ces programmes ciblent deux axes majeurs : l’éducation à l’entrepreneuriat et l’accompagnement des porteurs de projet.<\\/p><p><br><\\/p><p><strong>Company Program<\\/strong><\\/p><p>Conçu par Junior Achievement et adapté au contexte marocain par INJAZ Al-Maghrib, Company Program est un programme de création et de gestion d’entreprises par des lycéens et des étudiants.<\\/p><p>Durant 16 séances hebdomadaires de 2h, le cadre d’entreprise, qui dispense cette formation bénévolement, aborde avec ses élèves tout le cycle de vie d’une entreprise : création de l’identité visuelle, conception du produit ou service, étude de faisabilité, business plan, placement des actions de la société, production, commercialisation et liquidation de l’entreprise à la fin de l’année scolaire.<\\/p><p><br><\\/p><p><strong>Une célébration universelle<\\/strong><\\/p><p><span style=\\\"color: black;\\\">A la fin de la formation au Company Program, une compétition de la Meilleure Junior<\\/span><\\/p><p><span style=\\\"color: black;\\\">Entreprise de l’année est organisée dans chaque ville pour célébrer l’accomplissement<\\/span><\\/p><p><span style=\\\"color: black;\\\">des efforts des jeunes. Les vainqueurs de ces compétitions régionales participent ensuite à la finale nationale à Casablanca qui désigne les Junior Entreprises lauréates, dans les catégories lycée et université. Enfin, ces champions nationaux partent défendre les couleurs du Maroc lors de la compétition arabe regroupant toutes les Junior Entreprises finalistes des pays membres du réseau INJAZ Al-Arab.<\\/span><\\/p><p>&nbsp;<\\/p><p><strong>La compétition nationale de la meilleure Junior Entreprise 2016<\\/strong><\\/p><p>Organisée à Casablanca, la finale nationale regroupe les vainqueurs des compétitions régionales. Au total, 19 Junior Entreprises ont concouru pour le prix de la Meilleure Junior<\\/p><p>Entreprise de l’année dans deux catégories distinctes : lycée et université.<\\/p><p><br><\\/p><p>Le prix i-Tech de inwi a été décerné à&nbsp;<strong>FINE BUS du lycée Zerktouni d’Agadir<\\/strong>, encadrée par M. El Yousoufi d’Inwi et M. Makroum –&nbsp;<em>conception d’une application de localisation des arrêts de bus pour les passagers.&nbsp;<\\/em><\\/p>\",\"view_count\":\"29\",\"cta_inscription_externe\":\"\",\"live_label\":\"\"}'),(423,'fr','50','App\\Models\\Event','{\"id\":\"50\",\"title\":\"MIT Enterprise Forum Arab Startup\",\"description\":\"<p>Cinq start-up marocaines ont participé à la finale du <strong>MIT Enterprise Forum Arab Startup<\\/strong> Competition. Les cinq entreprises sont en effet les finalistes choisies au terme d’un appel à candidatures lancé par le MIT Entreprise Forum Pan Arab, suite à leur escale au Maroc chez inwi.<\\/p><p><br><\\/p><p>Il s’agit de <strong>Farasha Systems<\\/strong>, <strong>Eco-Heat<\\/strong>, <strong>Eko-Geste Dari<\\/strong>, <strong>Evaptainers<\\/strong> et <strong>Watech<\\/strong>.<\\/p><p><br><\\/p><p>Les cinq start-up sélectionnées ont participé d’abord à un bootcamp en Egypte ou en Jordanie&nbsp;durant les mois de février et mars 2017. Ils&nbsp;ont bénéficié de formations et de coaching en matière d’entrepreneuriat. La compétition finale se tiendra, elle, au Bahrein du 24 au 27 Avril.<\\/p><p><br><\\/p><p>Le MIT Entreprise Forum Arab Startup Competition, en partenariat avec la communauté <strong>Jameel<\\/strong> et l’opérateur Télécoms international <strong>Zain<\\/strong>, est le rendez-vous incontournable pour<strong> <\\/strong>primer l’innovation et encourager l’entrepreneuriat dans la région MENA.&nbsp;<\\/p>\",\"view_count\":\"41\",\"cta_inscription_externe\":\"\",\"live_label\":\"\"}'),(424,'fr','51','App\\Models\\Event','{\"id\":\"51\",\"title\":\"inwi Days 2018\",\"description\":\"<h3><span style=\\\"color: rgb(51, 51, 51);\\\">Pour sa sixième édition, inwi DAYS revient en janvier 2018 autour de la thématique&nbsp;<\\/span><strong style=\\\"color: rgb(51, 51, 51);\\\">\\\"le numérique au service de l\'éducation\\\"<\\/strong><\\/h3>\",\"view_count\":\"510\",\"cta_inscription_externe\":\"\",\"live_label\":\"\"}'),(425,'fr','53','App\\Models\\Event','{\"id\":\"53\",\"title\":\"Maroc Web Awards\",\"description\":\"<p>inwi continue d’accompagner l’écosystème digital marocain à travers son partenariat officiel de la 10<sup>ème<\\/sup> édition des Maroc Web Awards (MWA). inwi affirme ainsi son engagement à accompagner les jeunes talents du web marocains. Pour sa dixième édition, les maroc web awards se transforment en un festival qui s’étalera sur toute une journée – le dimanche 2 avril. Au menu, des séances de dédicaces par une belle brochette de stars du web, des ateliers animés, des rencontres et des débats. Le tout, dans une ambiance jeune et décontractée. Pas moins de 3000 personnes ont assisté à cette journée. En dix ans, Maroc Web Awards s’est imposé comme l’une des manifestations les plus importantes de la scène digitale marocaine. En plus de récompenser les talents de l’année en matière de production et de diffusion digitale, MWA est un moment privilégié de rencontres et d’échanges entre celles et ceux qui font, au quotidien, le web marocain et leurs communautés. Plusieurs moments forts ont rythmé la dixième édition des Maroc Web Awards&nbsp;: deux panels ont permis aux participants de débattre avec des experts du web marocains de sujets d’actualité comme «Millions de followers, quelle responsabilité ?». Quatre ateliers de formation étaient également prévus avec des sessions dédiées à la photographie, au storytelling, à la création vidéo et au blogging lifestyle.<\\/p>\",\"view_count\":\"82\",\"cta_inscription_externe\":\"\",\"live_label\":\"\"}'),(426,'fr','54','App\\Models\\Event','{\"id\":\"54\",\"title\":\"Moroccan Game Conferences\",\"description\":\"<p>Inwi et le collectif Maghreb Game Developpers ont organisé les 15 et 16 Octobre 2016 la <strong>«&nbsp;Maghreb Game Conference&nbsp;»<\\/strong>. Cet événement a réuni des acteurs de référence dans le domaine du Gaming au Maroc, en Algérie et en Tunisie. <\\/p><p>Les finalistes ont alors été appelés à développer leur jeu afin de le présenter dans l’espace <strong>Tech 22 Smart Africa For Change<\\/strong>, tenu en marge de la COP 22 à Marrakech. Le jeu gagnant a été dévoilé pendant la <strong>COP 22<\\/strong> a été proposé sur <a href=\\\"http:\\/\\/la3bin.inwi.ma\\/\\\" target=\\\"_blank\\\">La3bine<\\/a>, la plateforme gaming de inwi.<\\/p>\",\"view_count\":\"9\",\"cta_inscription_externe\":\"\",\"live_label\":\"\"}'),(427,'fr','55','App\\Models\\Event','{\"id\":\"55\",\"title\":\"DATA CITY - Demo Day\",\"description\":\"<p>Le Demo Day est une conférence qui célèbre la fin du programme d\'innovation ouverte <strong>#DataCity<\\/strong>.<\\/p><p><br><\\/p><p>Cet événement a été l\'occasion de découvrir les start-ups innovantes qui ont eu l\'opportunité de prototyper des solutions avec les grandes entreprises partenaires de <strong>DataCity<\\/strong>.<\\/p><p><br><\\/p><p>Les entrepreneurs et les représentant de nos partenaires ont pu partager leur expérience au sein du programme <strong>#DataCity<\\/strong> et présenter les résultats de l\'expérimentation.<\\/p><p><br><\\/p><p>En plus de l\'audience de la scène entrepreneuriale nationale, cet événement a réunit les entreprises, les autorités et les médias, parties prenantes essentielles pour la réussite d\'une dynamique de co-construction de la Casablanca de demain.<\\/p>\",\"view_count\":\"190\",\"cta_inscription_externe\":\"\",\"live_label\":\"\"}'),(429,'fr','61','App\\Models\\Event','{\"id\":\"61\",\"title\":\"inwi DAY\'s 2020\",\"description\":\"<p><strong style=\\\"color: rgb(51, 51, 51);\\\">Réservez votre place gratuitement pour la 8<\\/strong><sup style=\\\"color: rgb(51, 51, 51);\\\"><strong>e<\\/strong><\\/sup><strong style=\\\"color: rgb(51, 51, 51);\\\"> édition de inwiDAYS, sous la thématique de l’inclusion Financière<\\/strong><\\/p><p><br><\\/p><p><span style=\\\"color: rgb(51, 51, 51);\\\">Le&nbsp;<\\/span><strong style=\\\"color: rgb(153, 51, 255);\\\">6<\\/strong><\\/p><p><strong style=\\\"color: rgb(153, 51, 255);\\\">février 2020<\\/strong><span style=\\\"color: rgb(51, 51, 51);\\\">&nbsp;se<\\/span><\\/p><p><span style=\\\"color: rgb(51, 51, 51);\\\">tiendra la 8<\\/span><sup>e<\\/sup>&nbsp;édition des INWIDAYS à Casablanca pour clôturer le programme africain dédié aux Startups favorisant les technologies autour de l’inclusion financière.<\\/p><p><br><\\/p><p><span style=\\\"color: rgb(51, 51, 51);\\\">Des plateformes de crowdfunding aux solutions de micro-assurance, wallets et autres innovations inclusives dans le secteur de la finance, la thématique de cette année décrypte le potentiel et les contraintes à lever liées à un secteur prometteur pour le Continent. Des panelistes et speakers de renom, qui débâteront ensemble les réalités et opportunités du secteur, et partageront leurs expertises et retours d’expériences. Cette année connaîtra la participation exceptionnelle de Idriss Aberkane.<\\/span><\\/p><p><br><\\/p><p><span style=\\\"color: rgb(51, 51, 51);\\\">INWIDAYS est aussi le moment de célébrer 6 start-ups issues de 5 pays africains, porteurs d’innovations à découvrir lors de la compétition pour décerner le prix des meilleures startups de l’année. Des prix en numéraire et un accompagnement opérationnel à la clé pour les 2 meilleures start-ups retenues par les membres du jury. Un troisième prix, \\\"Prix du Public\\\", permettra à une troisième start-up de profiter de l\'univers digital&nbsp;<\\/span><strong>by inwi<\\/strong>&nbsp;pour propulser sa solution.<\\/p><p><br><\\/p><p><em style=\\\"color: rgb(51, 51, 51);\\\">Réservez sans plus tarder votre place gratuitement&nbsp;!<\\/em><\\/p><p><em style=\\\"color: rgb(51, 51, 51);\\\">Places prioritaires aux clients inwi.<\\/em><\\/p>\",\"view_count\":\"397\",\"cta_inscription_externe\":\"null\",\"live_label\":null}'),(431,'fr','65','App\\Models\\Event','{\"id\":\"65\",\"title\":\"Les initiatives « Tech & Digital » qui luttent con\",\"description\":\"<p><span style=\\\"color: rgb(34, 34, 34);\\\">Les initiatives «&nbsp;Tech &amp; Digital&nbsp;» qui luttent contre le COVID-19 au Maroc<\\/span><\\/p>\",\"view_count\":\"125\",\"cta_inscription_externe\":\"\",\"live_label\":\"\"}'),(433,'fr','71','App\\Models\\Event','{\"id\