st\",\"description\":\"<p>Une tribune de communication permettant de mettre en avant votre innovation digitale<\\/p>\"}'),(629,'fr','1','App\\Models\\Startup','{\"id\":\"1\",\"nom\":\"Logo 1\",\"link\":\"http:\\/\\/rct.webinnov.inwi.ma\\/\",\"title\":\"titre 1\",\"sub_title\":\"sous titre 1\",\"description\":\"\"}'),(630,'fr','2','App\\Models\\Startup','{\"id\":\"2\",\"nom\":\"Logo 2\",\"link\":\"http:\\/\\/rct.webinnov.inwi.ma\\/\",\"title\":\"\",\"sub_title\":\"\",\"description\":\"null\"}'),(631,'fr','3','App\\Models\\Startup','{\"id\":\"3\",\"nom\":\"Logo 3\",\"link\":\"http:\\/\\/rct.webinnov.inwi.ma\\/\",\"title\":\"\",\"sub_title\":\"\",\"description\":\"null\"}'),(632,'fr','4','App\\Models\\Startup','{\"id\":\"4\",\"nom\":\"Logo 4\",\"link\":\"http:\\/\\/rct.webinnov.inwi.ma\\/\",\"title\":\"\",\"sub_title\":\"\",\"description\":\"null\"}'),(633,'fr','5','App\\Models\\Startup','{\"id\":\"5\",\"nom\":\"Logo titre5\",\"link\":\"http:\\/\\/rct.webinnov.inwi.ma\\/\",\"title\":\"\",\"sub_title\":\"\",\"description\":\"\"}'),(635,'fr','7','App\\Models\\Startup','{\"id\":\"7\",\"nom\":\"Logo 7\",\"link\":\"http:\\/\\/rct.webinnov.inwi.ma\\/\",\"title\":\"\",\"sub_title\":\"\",\"description\":\"\"}'),(636,'fr','8','App\\Models\\Startup','{\"id\":\"8\",\"nom\":\"Logo 8\",\"link\":\"http:\\/\\/rct.webinnov.inwi.ma\\/\",\"title\":\"\",\"sub_title\":\"\",\"description\":\"\"}'),(638,'fr','4','App\\Models\\ReleaseContent','{\"id\":\"4\",\"content\":\"<p><strong>inwi poursuit son engagement auprès de l’écosystème des développeurs en Afrique et dans la région MENA. L’opérateur digital global était, cette année encore, le Partenaire Digital de la 8ème édition de l’événement Devoxx Morocco porté par les développeurs, pour les développeurs.&nbsp;<\\/strong><\\/p><p>Cette rencontre d’envergure, qui s’est tenue à Agadir du 12 au 14 novembre, est la plus grande manifestation dédiée aux développeurs en Afrique et dans la région MENA. L’événement a réuni plus de 2 000 participants issus de 50 nationalités et plus de 200 entreprises et start-ups. Des champions internationaux du codage et de la programmation étaient également au rendez-vous.<\\/p><p>Cette année, avec l’apport de inwi, le Devoxx Morocco a été marqué par la tenue de pas moins de 200 conférences, ateliers et keynotes autour de divers sujets (Cloud, Big Data, DevOps, Mobile, IoT, AI, Blockchain, etc…). L’occasion pour les participants de se pencher sur les enjeux de la révolution numérique à travers le rôle&nbsp;primordial que jouent les développeurs dans le domaine du digital.<\\/p><p>&nbsp;«&nbsp;inwi s’est engagé, depuis plusieurs années pour l’éclosion d’un écosystème digital performant et innovant dans notre pays. Pour cela, nous avons initié et accompagné plusieurs programmes de soutien aux entrepreneurs dans plusieurs domaines comme l’éducation, le gaming, ou encore les Civic-Techs. Nous nous engageons ainsi sur toute la chaîne de valeur en accompagnant les porteurs de projets dans toutes les étapes de leurs développements, de l’idée à la création de leur entreprise, puis au développement de cette dernière.&nbsp;», explique Rida Chahoud, Manager Open Innovation chez inwi.<\\/p><p>A travers ce partenariat exclusif avec Devoxx, inwi démontre une nouvelle fois, toute la teneur de son engagement dans l’accompagnement de la transformation digitale au Maroc à travers le soutien à des initiatives qui permettent d’accélérer le processus d’éclosion d’un écosystème digital compétitif.<\\/p>\",\"title\":\"Le plus grand événement dédié aux développeurs en Afrique signe une 8ème édition exceptionnelle \",\"release_id\":\"6\"}'),(639,'fr','6','App\\Models\\ReleaseContent','{\"id\":\"6\",\"content\":\"<p class=\\\"ql-align-justify\\\"><span style=\\\"color: windowtext;\\\">Partenaire des MWA depuis plusieurs années, inwi confirme, encore une fois, son engagement pour la promotion des créateurs de contenu digital, leur permettant de se développer et de faire évoluer leurs projets.<\\/span><\\/p><p class=\\\"ql-align-justify\\\"><span style=\\\"color: windowtext;\\\">La 12ème&nbsp;édition de ce concours, qui connecte et prime chaque année les meilleurs créateurs digitaux, s’est tenue ce dimanche 7 juillet à Casablanca. Au programme, un contenu de divertissement riche et varié, alliant musique, spectacles et humour.<\\/span><\\/p><p class=\\\"ql-align-justify\\\"><span style=\\\"color: windowtext;\\\">Le grand public a pu suivre, en temps réel, les résultats du concours grâce à une diffusion en direct sur les réseaux sociaux inwi et les plateformes web de 2M et de «&nbsp;Maroc Web Awards&nbsp;». Aussi, et pour la première fois, la cérémonie de remise des trophées sera également retransmise, mardi 9 juillet, sur la deuxième chaîne.&nbsp;<\\/span><\\/p><p class=\\\"ql-align-justify\\\"><span style=\\\"color: windowtext;\\\">La large diffusion de cet événement témoigne de son envergure en tant que rendez-vous incontournable exclusivement dédié au digital. Elle permet une plus grande ouverture vers un public plus large et plus éclectique, ainsi qu’une meilleure valorisation des MWA.<\\/span><\\/p><p class=\\\"ql-align-justify\\\"><span style=\\\"color: windowtext;\\\">Candidats, nominés, lauréats et participants sont venus nombreux assister aux interventions des invités inwi lors de cette grande manifestation et échanger avec eux. Le jury est composé d’éminentes personnalités de la scène digitale marocaine&nbsp;: entrepreneurs, blogueurs, photographes, YouTubeurs et anciens lauréats des MWA. Ce panel, composé de plus 150 personnes, ne cesse de s’agrandir et de se structurer afin de continuer, chaque année, à pérenniser et à donner encore plus de rayonnement à un événement aussi important. <\\/span><\\/p><p class=\\\"ql-align-justify\\\"><span style=\\\"color: windowtext;\\\">«&nbsp;<\\/span><em style=\\\"color: windowtext;\\\">Les Maroc Web Awards sont désormais l\'un des temps forts de l\'écosystème numérique national. Depuis plusieurs années, nous accompagnons cet événement qui soutient les créateurs de contenus digitaux dans leur évolution, tout en célébrant leur créativité, leur ingéniosité et leur esprit d\'innovation<\\/em><span style=\\\"color: windowtext;\\\">.&nbsp;<\\/span><em style=\\\"color: windowtext;\\\">Notre objectif est de promouvoir ces talents et multiplier les opportunités qu’offre la sphère digitale marocaine, tout en célébrant et cultivant l\'esprit d\'innovation et de créativité&nbsp;<\\/em><span style=\\\"color: windowtext;\\\">» déclare Brahim Amdouy, Manager des Contenus chez inwi.<\\/span><\\/p><p class=\\\"ql-align-justify\\\"><span style=\\\"color: windowtext;\\\">Plus de 100 finalistes ont participé dans 20 catégories différentes qui couvrent les thématiques les plus en vogue dans le domaine du digital&nbsp;: blogueur, créatif, vlogueur, Instagram, chaîne YouTube, page Facebook, application, musique, voyage, cuisine, science et éducation, humour, gaming, mode et beauté, technologie, sport et bien être, article en ligne, photographie, vidéo et site d’actualité.<\\/span><\\/p><p class=\\\"ql-align-justify\\\"><span style=\\\"color: windowtext;\\\">L’engouement des internautes marocains pour cette 12ème édition des «&nbsp;Maroc Web Awards&nbsp;» a dépassé toutes les prévisions. Plus de 1200 candidats s’étaient présentés aux différentes rubriques du concours. En à peine un mois, le site de Maroc Web Awards avait enregistré plus de 1,7 millions de visites et plus de 6 millions de pages vues. Plus de 700.000 votes concernant les 101 finalistes ont été répertoriés.<\\/span><\\/p><p class=\\\"ql-align-justify\\\"><span style=\\\"color: windowtext;\\\">Les lauréats qui avaient pris part aux éditions précédentes ont réussi, grâce aux MWA et au soutien de inwi, à se frayer un chemin vers le succès en tant que créateurs de contenu digital ou entrepreneurs du monde du digital.<\\/span><\\/p>\",\"title\":\"Cette année encore, les talents du web marocains ont été récompensés dans le cadre des « Maroc Web Awards » (MWA), la plus grande compétition web en Afrique du Nord et au Moyen Orient. \",\"release_id\":\"5\"}'),(640,'fr','7','App\\Models\\ReleaseContent','{\"id\":\"7\",\"content\":\"<h1 class=\\\"ql-align-justify\\\">L’édition de cette année, <\\/h1><h2 class=\\\"ql-align-justify\\\">tenue en présence de plus de 300 participants, <\\/h2><p class=\\\"ql-align-justify\\\">a mis la lumière sur le développement des fintech en Afrique en mettant à contribution Entrepreneurs et Investisseurs actifs dans l’écosystème des Startups, notamment celles dédiées aux technologies de l’inclusion financière. Il s’agit là, en effet, d’un secteur en plein essor dans lequel les startups redoublent d’ingéniosité pour développer des solutions innovantes facilitant l’accès aux services financiers.<\\/p><p class=\\\"ql-align-justify\\\"><br><\\/p><p class=\\\"ql-align-justify\\\">«&nbsp;<em>Qu’il s’agisse des plateformes de financement participatif, de solutions de micro-assurance, de mobile money, ou d’autres innovations inclusives dans le secteur de la finance, la thématique de cette année a permis de décrypter en profondeur les enjeux de l’inclusion financière et les axes de développement au Maroc et en Afrique. Les startups accompagnées par inwi ont, dans ce sens, un rôle majeur à jouer en proposant des solutions innovantes et à forte valeur ajoutée&nbsp;<\\/em>», a déclaré Rida Chahoud, Manager Open Innovation chez inwi.<\\/p><p class=\\\"ql-align-justify\\\"><br><\\/p><p class=\\\"ql-align-justify\\\">Lors de inwiDAYS, d’illustres panélistes et des speakers de renom sont tour à tour intervenus afin de débattre en profondeur des réalités et des opportunités de la finance inclusive en Afrique, tout en partageant leurs expertises et retours d’expériences. L’édition de cette année a notamment connu la participation exceptionnelle d’Idriss Aberkane, le conférencier et essayiste international, célèbre pour ses écrits et ses conférences sur l\'économie de la connaissance et les neurosciences.<\\/p><p class=\\\"ql-align-justify\\\"><br><\\/p><p class=\\\"ql-align-justify\\\">Depuis juin 2019, en effet, près de 400 startups issues de 23 pays africains ont pu présenter leurs solutions innovantes suite à un appel à candidature dédié au « <em>développement d’innovations financières inclusives<\\/em>&nbsp;» lancé par l’opérateur sur la plateforme «&nbsp;innov.inwi.ma&nbsp;».&nbsp;<\\/p><p class=\\\"ql-align-justify\\\"><br><\\/p><p class=\\\"ql-align-justify\\\">Au terme d’une première phase de sélection en septembre dernier, 11 startups ont bénéficié dans le cadre du programme «&nbsp;Impact&nbsp;Camp&nbsp;» de formations, coaching et accompagnement pour mieux structurer leurs projets et améliorer leurs concepts afin de concourir au prix «&nbsp;inwiDAYS&nbsp;».<\\/p><p class=\\\"ql-align-justify\\\"><br><\\/p><p class=\\\"ql-align-justify\\\">Ce 6 février à Casablanca, 6 startups finalistes issues de 5 pays africains (Maroc, Côte d’Ivoire, Burkina Faso, Ghana &amp; Cameroun) ont été retenues pour présenter leurs projets devant un jury d’experts&nbsp;:&nbsp;&nbsp;<\\/p><ul><li class=\\\"ql-align-justify\\\"><strong><em>Ishangoo <\\/em><\\/strong>: Solution digitale d\'aide à la micro épargne<\\/li><li class=\\\"ql-align-justify\\\"><strong><em>Sellwise<\\/em><\\/strong> : Solution unique multi wallets de paiement mobile&nbsp;&nbsp;&nbsp;<\\/li><li class=\\\"ql-align-justify\\\"><strong><em>Built <\\/em><\\/strong>: Plateforme web de gestion comptable destinée aux PMEs qui permet de créer automatiquement des profils crédit auprès des institutions de microfinance<\\/li><li class=\\\"ql-align-justify\\\"><strong><em>Yolse <\\/em><\\/strong>: Solution d\'accompagnement et de formation aux agriculteurs pour améliorer leurs credit-scoring sans garanties<\\/li><li class=\\\"ql-align-justify\\\"><strong><em>Onloutou<\\/em><\\/strong> : Solution de location du matériel électro-ménager sans garantie avec remboursements personnalisés<\\/li><li class=\\\"ql-align-justify\\\"><strong><em>Dibaka <\\/em><\\/strong>:&nbsp;Un chat bot intelligent qui reprend les fonctionnalités du wallet directement à travers WhatsApp<\\/li><\\/ul><p class=\\\"ql-align-justify\\\"><strong>Et les gagnants de la 8<\\/strong><sup><strong>ème<\\/strong><\\/sup><strong> édition de inwiDAYS sont&nbsp;:<\\/strong><\\/p><p class=\\\"ql-align-justify\\\"><br><\\/p><p class=\\\"ql-align-justify\\\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Prix du jury&nbsp;:<\\/strong> BUILT - Ghana<\\/p><p class=\\\"ql-align-justify\\\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Prix coup de cœur inwi&nbsp;:<\\/strong> Yolse \\/ Green Hope – Burkina Faso<\\/p><p class=\\\"ql-align-justify\\\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Prix du public&nbsp;:<\\/strong> Dibaka – Maroc&nbsp;<\\/p>\",\"title\":\"L’entreprenariat innovant au service de l’inclusion financière\",\"release_id\":\"7\"}'),(641,'fr','8','App\\Models\\ReleaseContent','{\"id\":\"8\",\"content\":\"<p class=\\\"ql-align-justify\\\">Pour sa 5<sup>e<\\/sup> édition, le programme Impact Camp confirme plus que jamais l’ouverture de inwi sur l’Afrique. Après une première phase d’appel à projets réussie, 14 projets ont pu être sélectionnés sur près de 400 candidatures émanant de 23 pays et collectées sur la plateforme innov.inwi.ma. Au programme, une semaine d’immersion qui a eu lieu du <span style=\\\"background-color: yellow;\\\">08 au 14 septembre 2019,<\\/span> au campus de l’Université Al Akhawayn à Ifrane sous le thème&nbsp;: \\\"La technologie pour <em>démocratiser l’accès aux services financiers \\\".<\\/em><\\/p><p class=\\\"ql-align-justify\\\"><em>«&nbsp;Au fil des éditions, l’Impact Camp s’impose comme un label reconnu d’accompagnement de projets à fort impact social ou environnemental. Une preuve supplémentaire de l’engagement de inwi aux côtés des entrepreneurs et de son action en faveur de l’innovation et de la transformation numérique de notre pays. Avec cette édition, nous renforçons notre action en mobilisant des talents africains pour contribuer à un échange d’expériences et d’opportunités entre les entrepreneurs de notre Continent»<\\/em>, explique Rida Chahoud, Manager Open Innovation chez inwi.<\\/p><p class=\\\"ql-align-justify\\\">A l’issue de cette 5<sup>ème<\\/sup> édition, l’Impact Camp développera davantage sa notoriété régionale en se positionnant comme le bootcamp de référence dédié aux Startups technologiques d’Afrique et en répondant aux problématiques socio-économiques des populations du Continent.<\\/p><p class=\\\"ql-align-justify\\\">inwi &amp; IMPACT Lab se donnent ainsi pour mission de connecter les entrepreneurs aux expertises nécessaires dans le but de mieux structurer leurs démarches entrepreneuriales et de leur apporter le cadre nécessaire pour développer leur visibilité et améliorer leurs chances de réussite.<\\/p><p class=\\\"ql-align-justify\\\">Les 8 projets finalistes participeront à inwiDAYS, prévu en janvier 2020. Les 2 start-ups gagnantes obtiendront un accès au programme d’incubation d’IMPACT Lab et un soutien financier pouvant aller jusqu’à 750&nbsp;000 dhs par start-up.<\\/p><p class=\\\"ql-align-justify\\\">&nbsp;<em>« L’Impact Camp 2019 continuera à monter en puissance à travers la sélection de start-ups africaines matures qui ont déjà prototypé et testé leurs solutions. L’accompagnement intensif que nous déploierons tout au long de cette semaine permettra à ces start-ups de challenger, mais aussi d’affiner et de valider leurs solutions afin d’accélérer leur mise sur le marché. Ce programme leur ouvrira également de nouvelles opportunités de développement grâce à un accès privilégié aux réseaux de inwi et d’IMPACT Lab<\\/em><strong>», conclut <\\/strong>Salma Kabbaj, co-fondatrice d’IMPACT Lab.<\\/p><p class=\\\"ql-align-justify\\\"><br><\\/p><p class=\\\"ql-align-justify\\\">Et les gagnants de l’Impact Camp 2019 sont&nbsp;:<\\/p><p class=\\\"ql-align-justify\\\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Sellwise de la Côte d’Ivoire<\\/p><p class=\\\"ql-align-justify\\\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Yolse du Burkina Faso<\\/p><p class=\\\"ql-align-justify\\\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Onloutou de la Côte d’Ivoire<\\/p><p class=\\\"ql-align-justify\\\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Built du Ghana<\\/p><p class=\\\"ql-align-justify\\\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Dibaka du Maroc<\\/p><p class=\\\"ql-align-justify\\\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;XxxxIshangoo du Cameroun<\\/p><p class=\\\"ql-align-justify\\\"><strong>À propos de inwi.<\\/strong><\\/p><p class=\\\"ql-align-justify\\\">Opérateur global des télécommunications, inwi est un acteur majeur de la transformation numérique au Maroc. Chaque jour, inwi accompagne particuliers et professionnels pour accéder au meilleur de la technologie et l’adopter dans tous les secteurs de la vie quotidienne. Pour plus d’information, visiter&nbsp;: <a href=\\\"http:\\/\\/www.inwi.ma\\/\\\" target=\\\"_blank\\\" style=\\\"color: rgb(51, 153, 204);\\\">www.inwi.ma<\\/a><\\/p><p class=\\\"ql-align-justify\\\"><strong>À propos d’IMPACT Lab&nbsp;:&nbsp;&nbsp;<\\/strong><\\/p><p class=\\\"ql-align-justify\\\">IMPACT Lab est un accélérateur de startups et d’innovation. Implanté au Maroc depuis 2014, IMPACT Lab, accompagne la transformation des startups, des entreprises et des institutions publiques pour leur permettre de répondre de façon innovante à leurs enjeux de croissance en Afrique. La mission d’IMPACT Lab est d’accélérer le développement de nouveaux modèles sociaux et économiques en Afrique pour un impact durable.<\\/p><p class=\\\"ql-align-justify\\\"><strong>À propos d’Impact Camp&nbsp;:<\\/strong><\\/p><p class=\\\"ql-align-justify\\\">Impact Camp est un programme conçu par IMPACT Lab pour accompagner des entrepreneurs innovants africains ayant développé des projets à fort impact social ou environnemental. Pendant 6 jours, ces entrepreneurs bénéficient de formations, d’ateliers de travail et de coaching dispensés par IMPACT Lab pour accélérer leurs projets. Dans le cadre du partenariat entre IMPACT Lab et inwi, les 8 meilleurs projets issus de l’Impact Camp seront accompagnés pour participer à inwiDAYS en Janvier 2020. A la clé pour les 2 gagnants de inwiDAYS,&nbsp;un support financier pouvant aller jusqu’à 750 000 dhs&nbsp;et un accès au programme d’incubation de IMPACT Lab.&nbsp;&nbsp;<\\/p>\",\"title\":\"Inwi confirme plus que jamais son positionnement en tant que plateforme d’accompagnement des entrepreneurs innovants à travers le lancement de la 5ème édition de l’Impact Camp. La 5e édition \",\"release_id\":\"8\"}'),(642,'fr','10','App\\Models\\ReleaseContent','{\"id\":\"10\",\"content\":\"<p>Plusieurs startups digitales ont su faire preuve d’agilité et de créativité pour développer rapidement des solutions adaptées à certains secteurs ou usages dans le contexte sanitaire actuel. <\\/p>\",\"title\":\"Découvrez 4 de ces Startups et leurs projets en vidéo.\",\"release_id\":\"9\"}'),(643,'fr','11','App\\Models\\ReleaseContent','{\"id\":\"11\",\"content\":\"https:\\/\\/youtu.be\\/odVdHjO_ZMI\",\"title\":\"Cam4Access : \",\"release_id\":\"9\"}'),(644,'fr','12','App\\Models\\ReleaseContent','{\"id\":\"12\",\"content\":\"https:\\/\\/youtu.be\\/NeAXGteRHio\",\"title\":\"Koulna1.ma : \",\"release_id\":\"9\"}'),(645,'fr','18','App\\Models\\ReleaseContent','{\"id\":\"18\",\"content\":\"https:\\/\\/www.youtube.com\\/watch?v=vhgZqdot298&feature=youtu.be\",\"title\":\"\",\"release_id\":\"8\"}'),(646,'fr','19','App\\Models\\ReleaseContent','{\"id\":\"19\",\"content\":\"https:\\/\\/www.youtube.com\\/watch?v=1b9nzLvx_HQ\",\"title\":\"test1\",\"release_id\":\"12\"}'),(647,'fr','20','App\\Models\\ReleaseContent','{\"id\":\"20\",\"content\":\"https:\\/\\/www.youtube.com\\/watch?v=-rfXy2oGI_g&list=PLDn9ANVRI8D8uhU-eixkpk86uPR6Z1lmY&index=8\",\"title\":\"pip pip yalah5\",\"release_id\":\"12\"}'),(6