te, cliquez sur le bouton +.<\\/p><p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Renseignez votre nom, votre prénom et acceptez les conditions générales d’utilisation et la politique de confidentialité (*)<\\/p><p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Cliquez sur «&nbsp;suivant&nbsp;»<\\/p><p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Entrez votre adresse e-mail et votre mot de passe.<\\/p><p>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Cliquez sur&nbsp;«&nbsp;Je m’inscris&nbsp;».<\\/p><p>6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Pour finaliser la création de votre compte, vous devez confirmer votre adresse e-mail.<\\/p><p>&nbsp;* Vous pouvez vous inscrire en utilisant un compte (LinkedIn, Instagram, Facebook, Twitter)<\\/p>\"}'),(661,'fr','35','App\\Models\\Question','{\"id\":\"35\",\"question\":\"Pourquoi n\'ai-je pas reçu un e-mail de confirmation de participation à un événement ?\",\"reponse\":\"<p>Si vous n\'avez pas reçu l’email de confirmation sur votre boite de réception, veuillez consulter votre dossier Courrier indésirable (Spam).<\\/p>\"}'),(662,'fr','37','App\\Models\\Question','{\"id\":\"37\",\"question\":\"Pourquoi participer aux programmes de inwi innov ?\",\"reponse\":\"<p>×&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Booster votre projet innovant,<\\/p><p>×&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Accéder à des partenaires privilégiés,<\\/p><p>×&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Faire partie d’une communauté d’entrepreneurs,<\\/p><p>×&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Bénéficier d’un accompagnement entrepreneurial,<\\/p>\"}'),(663,'fr','38','App\\Models\\Question','{\"id\":\"38\",\"question\":\"D’autres questions ?\",\"reponse\":\"<p>Contactez-nous via le formulaire:<\\/p><p><a href=\\\"https:\\/\\/innov.inwi.ma\\/contact\\\" target=\\\"_blank\\\">https:\\/\\/innov.inwi.ma\\/contact<\\/a><\\/p>\"}'),(664,'fr','50','App\\Models\\Project2','{\"id\":\"50\",\"lastname\":\"Benkirane\",\"firstname\":\"Maria\",\"function\":\"\",\"organisme\":\"\",\"city\":\"\",\"country\":\"\",\"startup_name\":\"\",\"startup_logo_name\":null,\"office_address\":\"\",\"maturity_stage\":null,\"nbr_founders\":\"1\",\"nbr_contributors\":\"1\",\"website\":\"\",\"facebook\":\"\",\"twitter\":\"\",\"instagram\":\"\",\"linkedin\":\"\",\"startup_description\":\"\",\"startup_video\":\"\",\"problem\":\"\",\"solution\":\"\",\"solution_how\":\"\",\"market\":\"\",\"market_size\":\"\",\"market_user\":\"\",\"client1\":\"\",\"client2\":\"\",\"pricing_model\":\"\",\"challenges\":\"\",\"goal\":\"\",\"more_docs\":null,\"more_docs_name\":null,\"question1\":null,\"question2\":null,\"question3\":null,\"viewCount\":\"0\",\"num_team\":\"1\",\"evaluation_5\":\"0\",\"evaluation_6\":\"0\",\"evaluation_7\":\"0\",\"evaluation_8\":\"0\",\"status_2\":\"\",\"comment_2\":\"\",\"status\":\"in_progress\",\"challenge_id\":\"11\",\"user_id\":178,\"question1_2\":null,\"question2_2\":null,\"question3_2\":null,\"status_valid\":null}'),(665,'ar','50','App\\Models\\Project2','{\"id\":\"50\",\"lastname\":\"Benkirane\",\"firstname\":\"Maria\",\"function\":\"\",\"organisme\":\"\",\"city\":\"\",\"country\":\"\",\"startup_name\":\"\",\"startup_logo_name\":null,\"office_address\":\"\",\"maturity_stage\":null,\"nbr_founders\":\"1\",\"nbr_contributors\":\"1\",\"website\":\"\",\"facebook\":\"\",\"twitter\":\"\",\"instagram\":\"\",\"linkedin\":\"\",\"startup_description\":\"\",\"startup_video\":\"\",\"problem\":\"\",\"solution\":\"\",\"solution_how\":\"\",\"market\":\"\",\"market_size\":\"\",\"market_user\":\"\",\"client1\":\"\",\"client2\":\"\",\"pricing_model\":\"\",\"challenges\":\"\",\"goal\":\"\",\"more_docs\":null,\"more_docs_name\":null,\"question1\":null,\"question2\":null,\"question3\":null,\"viewCount\":\"0\",\"num_team\":\"1\",\"evaluation_5\":\"0\",\"evaluation_6\":\"0\",\"evaluation_7\":\"0\",\"evaluation_8\":\"0\",\"status_2\":\"\",\"comment_2\":\"\",\"status\":\"in_progress\",\"challenge_id\":\"11\",\"user_id\":\"178\",\"question1_2\":null,\"question2_2\":null,\"question3_2\":null,\"status_valid\":null}'),(666,'fr','55','App\\Models\\ProjectResponse','{\"id\":\"55\",\"response\":null,\"question_id\":7,\"section_name\":\"section 2\",\"project_id\":\"50\",\"question\":\"Pouvez vous mettre un texte court?\"}'),(667,'fr','56','App\\Models\\ProjectResponse','{\"id\":\"56\",\"response\":null,\"question_id\":8,\"section_name\":\"section 2\",\"project_id\":\"50\",\"question\":\"Pouvez vous mettre un texte long?\"}'),(668,'ar','55','App\\Models\\ProjectResponse','{\"id\":\"55\",\"response\":null,\"question_id\":\"7\",\"section_name\":\"section 2\",\"project_id\":\"50\",\"question\":\"Pouvez vous mettre un texte court?\"}'),(669,'ar','56','App\\Models\\ProjectResponse','{\"id\":\"56\",\"response\":null,\"question_id\":\"8\",\"section_name\":\"section 2\",\"project_id\":\"50\",\"question\":\"Pouvez vous mettre un texte long?\"}'),(671,'ar','34','App\\Models\\ReleaseContent','{\"id\":\"34\",\"content\":\"<p><em>Mohammed Ait Addi et Réda Lakhlifi, fondateurs de Saweblia, la startup fondée en 2019, nous font part de leur retour d’expérience et de conseils importants pour les futurs entrepreneurs désirant lancer leurs startups.<\\/em><\\/p><p><em>Saweblia est un «&nbsp;full-service provider&nbsp;» des travaux de réparation et de réaménagement à domicile et pour les locaux professionnels.<\\/em><\\/p>\",\"title\":\" \",\"release_id\":\"18\"}'),(672,'ar','35','App\\Models\\ReleaseContent','{\"id\":\"35\",\"content\":\"<p><em>«&nbsp;Le moment où nous aurons besoin de faire une levée de fond, c’est lorsque nous arrivons au maximum de nos capacités avec les moyens actuels, et quand le cash burn est la seule contrainte qui ne nous permets pas de faire mieux.&nbsp;» <\\/em>déclare Mohammed Ait Addi.<\\/p><p>Ce qu’il faut retenir, c’est que le mot d’ordre reste la bonne préparation, pour avoir plus de chance de réussite lorsqu’un investisseur s’intéressera à son projet. Bien évidemment, en amont, il faudra développer son réseau et bien préparer sa levée de fond.<\\/p>\",\"title\":\"Pour assurer la croissance de sa startup, l’une des formes de financement les plus utilisées est la levée de fond. Cependant, ce n’est jamais l’entrepreneur qui décide du recours à une levée de fond mais ce sont plutôt le marché et l’investisseur.\",\"release_id\":\"18\"}'),(673,'ar','36','App\\Models\\ReleaseContent','{\"id\":\"36\",\"content\":\"<p>Selon les fondateurs de Saweblia, il y’a 3 typologies d’indicateurs importants qu’un entrepreneur doit suivre de manière régulière&nbsp;:<\\/p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Les indicateurs de croissance :<\\/strong> le nombre de clients à date, et le nombre de clients ayant fait appel une seconde fois au service de la startup.<\\/p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Les indicateurs opérationnels<\\/strong>, ou <em>l’efficience opérationnelle<\\/em>, c’est comment gérer le back office, et comment organiser les process (délais de réponses, traitement des réclamations, …)<\\/p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Les indicateurs financiers<\\/strong>, c’est l’état de la trésorerie, les bénéfices réalisés, …<\\/p><p>La lecture de ces trois indicateurs, permettra à l’entrepreneur de voir les progressions par rapport à vos objectifs, et réagir en cas de déséquilibre.<\\/p>\",\"title\":\"Les 3 KPI importants à retenir selon Saweblia\",\"release_id\":\"18\"}'),(674,'ar','37','App\\Models\\ReleaseContent','{\"id\":\"37\",\"content\":\"<p>D’abord, il faut évaluer le potentiel de l’idée en la «&nbsp;pitchant&nbsp;» à ses futurs clients, fournisseurs et partenaires. Ensuite, il est important de tester cette idée en créant, par exemple, un prototype et le tester sur le marché.<\\/p><p>Passée cette étape, si le test n’est pas concluant, l’entrepreneur est décidé sur la pertinence de son idée de projet. Par contre, si cela fonctionne, c’est probablement le début d’une grande histoire.<\\/p><p>Par ailleurs, les porteurs de projets ont aujourd’hui la possibilité d’accéder à des incubateurs qui pourront les financer à hauteur de 200 000 Dhs pour mieux démarrer leur projet de startup.<\\/p><p><em>«&nbsp;Au Maroc comme dans d’autres pays, il est recommandé d’avoir un minium d’expériences que ça soit professionnel, associatif ou sportif…Cela met toutes les chances de réussir de son côté. Cependant, il faut savoir que l’âge ou le budget&nbsp;ne sont pas les paramètres les plus importants pour réussir.» <\\/em>conclut Mohammed Ait Addi.<\\/p>\",\"title\":\"Pour lancer sa startup et pouvoir trouver les fonds nécessaires pour accompagner sa croissance, les fondateurs de Saweblia recommandent un process simple pour commencer.\",\"release_id\":\"18\"}'),(675,'ar','38','App\\Models\\ReleaseContent','{\"id\":\"38\",\"content\":\"<p>Selon l’expérience de Saweblia, tout se joue lorsqu’on fait rencontrer l’idée au marché (Clients, fournisseurs, partenaires potentiels, …), c’est à ce moment précis que les contraintes opérationnelles du marché sont mises en évidence.<\\/p><p><em>«&nbsp;Au démarrage, nous avions déjà un produit très complet technologiquement, ça aurait pu mieux démarrer sur des marchés familiarisés avec les concepts des Markets places. Nos clients reviennent chez nous car nous ne sommes pas une simple Market place, mais plutôt un Full-service Provider qui les rassure ». <\\/em>Déclare Réda Lakhlifi.<\\/p>\",\"title\":\"De plus en plus de concepts de Marketplace voient le jour, mais très peu d’entre eux arrivent à décoller. \",\"release_id\":\"18\"}'),(676,'ar','39','App\\Models\\ReleaseContent','{\"id\":\"39\",\"content\":\"<p><em>«&nbsp;Si aujourd’hui, Saweblia se démarque de ses concurrents sur le marché, c’est grâce à la qualité et l’implication des Maalems avec qui nous travaillons. C’est pourquoi nous développons quotidiennement une relation de confiance et de proximité avec ces maalems.»<\\/em> disait Mohammed Ait Addi, Co-fondateur de Saweblia.<\\/p><p>Ainsi, depuis son démarrage, Saweblia fournit à ses fournisseurs principaux, les professionnels des travaux de réparation et de réaménagement, des avantages de forte valeur ajoutée pour faciliter leur quotidien. Cela sous forme de formations co-financées par de grands acteurs sectoriels comme celles dédiées aux métiers de plomberie et électricité. Aussi, Saweblia facilite l’accès de ces maalems aux conventions bancaires aussi bien au niveau de l’aspect procédural que l’aspect contractuel. Et pour mieux équiper ces professionnels, Saweblia a noué des partenariats avec les marques d’outillage, pour mettre à la disposition des maalems, les outils de travail nécessaires à des prix réduits.<\\/p><p><em>« Saweblia, est un Full service Provider – autrement dit une Market place ++ - qui se doit d’offrir la meilleure expérience client possible et garantir une réactivité de la part de nos prestataires à un nombre plus important de clients que ce que nous avons aujourd’hui, … A cet effet, il est indispensable d’offrir une expérience aussi agréable pour les maalems que pour les clients avec le package des avantages que nous avons mis en place.&nbsp;»<\\/em> déclare Réda Lakhlifi, Co-fondateur de Saweblia.<\\/p>\",\"title\":\"Saweblia, une Startup qui mise sur la proximité avec les Maalems, professionnels des travaux de réparation et réaménagement.\",\"release_id\":\"18\"}'),(679,'ar','8','App\\Models\\Capsule','{\"id\":\"8\",\"title\":\"Capsules\",\"subTitle\":\"Capsules\",\"description\":\"<p>CapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsulesCapsules<\\/p>\"}'),(680,'ar','7','App\\Models\\Capsule','{\"id\":\"7\",\"title\":\"كبسولة الاختبار\",\"subTitle\":\"كبسولة الاختبار\",\"description\":\"<p>كبسولة الاختباركبسولة الاختباركبسولة الاختباركبسولة الاختباركبسولة الاختباركبسولة الاختباركبسولة الاختباركبسولة الاختبار<\\/p>\"}'),(681,'ar','21','App\\Models\\Challenge2','{\"id\":\"21\",\"title\":\"اكتشف إمكانيات التعامل مع INWI!\",\"description\":\"<p>هل تمثل مقاولة ناشئة أو تقوم بتطوير حلول مبتكرة؟<\\/p><p><br><\\/p><p>اكتشف إمكانات التعامل مع inwi!<\\/p><p>inwi&nbsp;فاعل مركزي في التحول الرقمي في المغرب. مهمتنا هي إعطاء رواد الأعمال، الأدوات اللازمة لنجاحهم وتطورهم. منذ عدة سنوات ، انخرطنا في برنامج طموح لدعم النظام البيئي لريادة الأعمال وتشجيع ريادة الأعمال ، والتي تحقق الآن نتائج ملموسة<\\/p><p>انطلاقًا من هذا الالتزام ، تسعى inwi إلى التعاون مع المقاولات الناشئة المبتكرة التي تقدم حلولًا رقمية ذات قيمة مضافة عالية. يجب أن تقدم هذه المقاولات الناشئة الحلول ذات الصلة ، والتي تسمح بحل المشكلات التشغيلية ، لخدمة ملايين المغاربة معًا بشكل أفضل.<\\/p><p class=\\\"ql-align-right\\\"><br><\\/p>\",\"due_date\":\"0000-00-00 00:00:00\",\"lastname\":\"النسب\",\"lastname_label\":\"النسب\",\"firstname\":\"اسم\",\"firstname_label\":\"اسم\",\"birthday\":\"Date de naissance\",\"birthday_label\":\"Date de naissance\",\"function\":\"Fonction\",\"function_label\":\"Fonction\",\"organisme\":\"Organisme\",\"organisme_label\":\"Organisme\",\"city\":\"مدينة\",\"city_label\":\"مدينة\",\"country\":\"Pays de résidence\",\"country_label\":\"بلد\",\"startup_name\":\"اسم\",\"startup_name_label\":\"اسم\",\"office_address\":\"عنوان\",\"office_address_label\":\"عنوان\",\"maturity_stage\":\"Stade de maturité\",\"maturity_stage_label\":\"Stade de maturité\",\"nbr_founders\":\"عدد المؤسسين\",\"nbr_contributors\":\"Quel est le nombre de vos collaborateurs internes?\",\"website\":\"Site internet\",\"website_label\":\"Site internet\",\"cv\":\"CV équipes\",\"cv_label\":\"CV équipes\",\"startup_description\":\"Insérez une petite description de votre Startup\",\"startup_description_label\":\"Insérez une petite description de votre Startup\",\"startup_video\":\"\",\"startup_video_label\":\"Insérez une vidéo d’une minute de votre Startup\",\"problem\":\"Décrivez le problème dont souffrent vos utilisateurs et que vous essayez de r