\":\"0\",\"evaluation_7\":\"0\",\"evaluation_8\":\"0\",\"status_2\":\"\",\"comment_2\":\"\",\"status\":\"in_progress\",\"challenge_id\":\"21\",\"user_id\":177,\"question1_2\":null,\"question2_2\":null,\"question3_2\":null,\"status_valid\":null}'),(688,'ar','57','App\\Models\\ProjectResponse','{\"id\":\"57\",\"response\":null,\"question_id\":35,\"section_name\":\"دعوة للمشاريع\",\"project_id\":\"51\",\"question\":\"عدد المؤسسين؟\"}'),(689,'ar','12','App\\Models\\Partner','{\"id\":\"12\",\"name\":\"لافكتري\"}'),(690,'fr','82','App\\Models\\Event','{\"id\":\"82\",\"title\":\"INWI DAYS 2021\",\"description\":\"<p>تسجل مجانًا لمتابعة مباشرةً النسخة التاسعة من inwiDAYS ، تحت موضوع الانتعاش الاقتصادي من خلال الابتكار ، في 25 و 26 فبراير 2021.<\\/p><p>سنة 2020، سنة استثنائية سلط فيها الضوء على مساهمة المقاولات المبتكرة الشابة في إعادة اختراع المهن والخدمات المتوافقة مع سياق جائحة كورونا.<\\/p><p>في نسختها التاسعة ، التي ستقام في 25 و 26 فبراير 2021 ، ستكون inwiDAYS فرصة لاكتشاف هؤلاء الشابات والرجال الذين يعملون في قطاع المقولات الناشئة في المغرب ومعرفة آرائهم حول مستقبل قطاع ريادة الأعمال و الابتكار في إحياء الديناميكيات الاقتصادية ما بعد الجائحة الحالية في المغرب.<\\/p>\",\"view_count\":\"0\",\"cta_inscription_externe\":\"تسجل مجانًا\",\"live_label\":\"تسجل مجانًا\"}'),(691,'ar','82','App\\Models\\Event','{\"id\":\"82\",\"title\":\"INWI DAYS 2021\",\"description\":\"<p>تسجل مجانًا لمتابعة مباشرةً النسخة التاسعة من inwiDAYS ، تحت موضوع الانتعاش الاقتصادي من خلال الابتكار ، في 25 و 26 فبراير 2021.<\\/p><p>سنة 2020، سنة استثنائية سلط فيها الضوء على مساهمة المقاولات المبتكرة الشابة في إعادة اختراع المهن والخدمات المتوافقة مع سياق جائحة كورونا.<\\/p><p>في نسختها التاسعة ، التي ستقام في 25 و 26 فبراير 2021 ، ستكون inwiDAYS فرصة لاكتشاف هؤلاء الشابات والرجال الذين يعملون في قطاع المقولات الناشئة في المغرب ومعرفة آرائهم حول مستقبل قطاع ريادة الأعمال و الابتكار في إحياء الديناميكيات الاقتصادية ما بعد الجائحة الحالية في المغرب.<\\/p><p>inwiDAYS<\\/p><p>هو أيضًا الفرصة لتثويج ثلاث مقولات ناشئة وناقلة للابتكارات سيتم اكتشافها في اليوم الثاني لمنح جائزة أفضل المقاولات الناشئة لهذا العام. ستسمح هذه الجوائز لهذه الشركات الناشئة بالاستفادة من عالم<\\/p><p>inwi<\\/p><p>الرقمي بهدف صلط الضوء على حلولهم<\\/p><p>تسجل الأن و إلتحق بنا لإكتشاف مستقبل المقاولات الناشئة ودورها في الانتعاش الاقتصادي!<\\/p><h2><span style=\\\"color: rgb(153, 51, 255);\\\">المقاولات الناشئة الحائزة على جوائز InwiDAYS 2021 هي:<\\/span><\\/h2><ol><li><strong>جائزة InwiDAYS لأفضل مقاولة ناشئة ذات طموح إفريقي&nbsp;: ShipEx<\\/strong><\\/li><li><strong>جائزة InwiDAYS لأفضل تأثير إيجابي للعام: SanteConnect<\\/strong><\\/li><li><strong>جائزة جمهورInwiDAYS: LaClasse.ma<\\/strong><\\/li><\\/ol>\",\"view_count\":\"0\",\"cta_inscription_externe\":\"تسجل مجانًا\",\"live_label\":\"تسجل مجانًا\"}'),(692,'ar','19','App\\Models\\Release','{\"id\":\"19\",\"title\":\"نجاح كبير للموسم الأول من برنامج \\\"شكون غادي يستثمر في مشروعي؟ \",\"description\":\"<p>متابعة إستثنائية على شاشة التلفزيون: قرابة 3 ملايين مشاهد، مساء كل ثلاثاء، خلال كل برايم منذ البث الأول، بالإضافة إلى 7 ملايين مشاهد عند عرض ربورطاجات البرنامج.<\\/p><p>أرقام قياسية تم تسجيلها على مستوى المنصات الرقمية، إذ وصل نطاق المتأثرين إلى 40 مليون شخصا، ومساهمات قيمة ترجمت الحماس الذي رافق البرنامج.<\\/p><p>ل<\\/p>\"}'),(693,'ar','40','App\\Models\\ReleaseContent','{\"id\":\"40\",\"content\":\"<p>لقد حقق الموسم الأول من برنامج \\\"شكون غادي يستثمر في مشروعي؟ \\\" نجاحا وشعبية حقيقية لدى الجمهور المغربي، حيث سجل هذا البرنامج، الأول من نوعه في المغرب العربي والمخصص للمقاولات الناشئة، متابعة قياسية طوال مدة بثه. وسجلت برايمات البرنامج مشاهدة قياسية فاقت 3 ملايين مشاهد في كل برايم.&nbsp;<\\/p>\",\"title\":\"\",\"release_id\":\"19\"}'),(694,'ar','41','App\\Models\\ReleaseContent','{\"id\":\"41\",\"content\":\"<p>وتم إطلاق هذا البرنامج الشامل، المخصص للمقاولات الناشئة، من قبل القناة الثانية وبشراكة مع إنوي. ويجسد التزام الشريكين بتعزيز الاقتصاد الرقمي الجديد ودعم نمو المقاولات المغربية الناشئة.&nbsp;<\\/p><p>وصرح سليم الشيخ، المدير العام لمجموعة \\\"SOREAD 2M\\\" قائلا: » نحن سعداء بالاهتمام والإقبال الذي عرفه البرنامج سواء على شاشة التلفزيون أو على المنصات الرقمية. لقد سجلنا نسب مشاهدة قياسية تؤكد الإهتمام الذي يوليه المغاربة للإستثمار والمقاولات ببلادنا. وبصفتنا وسيلة إعلام مواطنة ذات منفعة عامة، كان هدفنا من البرنامج هو المساهمة في خلق ديناميكية مقاولاتية جديدة لدى الشباب وتوفير الوسائل اللازمة للتعريف بمشاريعهم والحصول على مواكبة قيمة. ونتمنى أيضا أن نكون قد أعطينا لشباب آخرين فرصة دخول عالم المقاولات. «<\\/p><p>وعبرت نادية رحيم، مديرة العلامات التجارية والتواصل لدى إنوي قائلة:» نحن فخورون بمواكبة المقاولات الناشئة المغربية ومساهمتنا في التعريف بها لدى العموم عبر هذا البرنامج الذي حقق نتائج إستثنائية على كل المستويات. وبتوالي برايمات البرنامج تم تقديم مشاريع مبتكِرة وذات قيمة مضافة في عدة مجالات. ويواصل إنوي بذلك مواكبته للمقاولات الناشئة المغربية لمساعدتها على تحقيق مشاريعها وتسريع وتيرة نموها. «<\\/p><p>وصرح مهدي علوي، المدير التنفيذي والمؤسس لـ \\\" LaStartupFactory \\\" قائلا: » تمكن هذا البرنامج من إدخال مفهوم المقاولات الناشئة إلى كل البيوت المغربية وتحفيز الملايين من الشباب في مجال المقاولات المبتكرة وإعطائهم الأمل والثقة. هذا البرنامج التلفزي هو بمثابة نموذج تفكير جديد تشهده بلادنا. ويعتبر برنامج \\\"شكون غادي يستثمر في مشروعي؟ \\\" فرصة ملموسة للتمويل لكل مقاولة ناشئة ومواكبتها من طرف مستثمرين ناجحين. وبانتهاء الموسم الأول من هذا البرنامج سيتم مواصلة مواكبة المقاولين من طرف \\\" LaStartupFactory\\\" للحصول على تمويلات لمشاريعهم وتسريع وتيرتها. «&nbsp;<\\/p>\",\"title\":\"\",\"release_id\":\"19\"}'),(695,'ar','42','App\\Models\\ReleaseContent','{\"id\":\"42\",\"content\":\"https:\\/\\/www.youtube.com\\/watch?v=qBniSSNaWh4\",\"title\":\"دعوة للمشاريع\",\"release_id\":\"19\"}'),(696,'ar','1','App\\Models\\Emission','{\"id\":\"1\",\"title\":\"STARTUP: شكون يستثمر فمشروعي؟\",\"subTitle\":\"أول برنامج مخصص للمقاولات الناشئة الرقمية ورواد الأعمال\",\"description\":\"تقدم inwi بشراكة مع 2M، أول برنامج أفريقي الذي يمنح الفرصة للمقولات الناشئة بمقابلة المستثمرين ! مبدأ هدا البرنامج  يمنح لمؤسسي المقاولات الناشئة بتقديم مشاريعهم أمام 5 مستثمرين مغاربة من القطاع الخاص و الذين يمثلون الديناميكية والإبداع المغربي. هم في نفس الوقت، رواد أعمال ومديري مقاولات ناجحة، سيمنحون هؤلاء المستثمرين للمواهب الشابة فرصة لتطوير مشاريعهم  من خلال استثمار مادي والوقت والمهارات.\\n\\nسيتم بث 6 برايمات على 2M. مرفقة بيوميات لمشاهدة  كواليس اختيار المشاركين الـ 24 في البرنامج و مراحل استعدادهم.\",\"subTitle2\":\"\",\"description2\":\"\",\"saison\":\"Saison 1 - 2020\",\"title_prime\":\"برايمات\",\"subTitle_prime\":\"استرجع لحظات البرايمات واكتشف المقاولات الناشئة التي إستطاعت إقناع المستتمرين اعتبارًا إبتداءً من 24 نونبر 2020\",\"cta_prime\":\"جميع البرايمات\",\"title_startup\":\"المقاولات الناشئة المشاركة\",\"cta_startup\":\"اكتشاف\",\"title_capsule\":\"اكتشف كواليس البرنامج و بورتريات المرشحين والمستثمرين\",\"subTitle_capsule\":\"\",\"cta_capsule\":\"كل الكبسولات\",\"title_investisseur\":\"المستتمرين\",\"title_entrepreneurs\":\"المقاولين\",\"title_galeries\":\"معرض الصور\",\"title_fond\":\"مبلغ إجمالي \",\"subTitle_fond\":\"اكتشف المبلغ الإجمالي الذي حصلت عليه المقاولات الناشئة\"}'),(697,'fr','1','App\\Models\\Emission','{\"id\":\"1\",\"title\":\"STARTUP: شكون يستثمر فمشروعي؟\",\"subTitle\":\"Le 1er techshow dédié aux Startups et aux entrepreneurs du digital\",\"description\":\"inwi, en partenariat avec 2M, lance « Startup », le 1er techshow africain de confrontation en prime time de Startups et des investisseurs !  \\n\\n« Startup » repose sur un concept simple : elle permet de réunir, lors de chaque prime, les fondateurs d’une Startup avec 5 investisseurs privés marocains qui incarnent le dynamisme et la créativité Marocaine. Entrepreneurs et gestionnaires d’entreprises à succès, ces « Business Angels » donneront une chance aux nouveaux talents et seront prêts à investir de l’argent, du temps et des compétences dans les startups prometteuses.\\n\\nEn tout, 6 primes de « Startup » seront diffusées sur 2M à partir du 24 novembre 2020 et jusqu’au 29 décembre. Les coulisses de sélecti