ect_id\":82,\"question\":\"Dans quel cadre, souhaitez-vous développer votre collaboration avec inwi ?\",\"response_option\":null}'),(914,'fr','94','App\\Models\\ProjectResponse','{\"id\":94,\"response\":\"test\",\"question_id\":31,\"section_name\":\"Collab inwi\",\"project_id\":82,\"question\":\"Qu’espérez-vous atteindre à travers votre collaboration avec inwi ? Et comment est-ce que inwi pourrait accompagner votre développement ?\",\"response_option\":null}'),(915,'fr','19','App\\Models\\Release','{\"id\":19,\"title\":\"نجاح كبير للموسم الأول من برنامج \\\"شكون غادي يستثمر في مشروعي؟ \",\"description\":\"<p class=\\\"ql-align-right\\\">متابعة إستثنائية على شاشة التلفزيون: قرابة 3 ملايين مشاهد، مساء كل ثلاثاء، خلال كل برايم منذ البث الأول، بالإضافة إلى 7 ملايين مشاهد عند عرض ربورطاجات البرنامج.<\\/p><p class=\\\"ql-align-right\\\">أرقام قياسية تم تسجيلها على مستوى المنصات الرقمية، إذ وصل نطاق المتأثرين إلى 40 مليون شخصا، ومساهمات قيمة ترجمت الحماس الذي رافق البرنامج.<\\/p><p class=\\\"ql-align-right\\\">ل<\\/p>\"}'),(916,'fr','40','App\\Models\\ReleaseContent','{\"id\":40,\"content\":\"<p>لقد حقق الموسم الأول من برنامج \\\"شكون غادي يستثمر في مشروعي؟ \\\" نجاحا وشعبية حقيقية لدى الجمهور المغربي، حيث سجل هذا البرنامج، الأول من نوعه في المغرب العربي والمخصص للمقاولات الناشئة، متابعة قياسية طوال مدة بثه. وسجلت برايمات البرنامج مشاهدة قياسية فاقت 3 ملايين مشاهد في كل برايم.&nbsp;<\\/p>\",\"title\":\"\",\"release_id\":19}'),(917,'fr','42','App\\Models\\ReleaseContent','{\"id\":42,\"content\":\"https:\\/\\/www.youtube.com\\/watch?v=qBniSSNaWh4\",\"title\":\"دعوة للمشاريع\",\"release_id\":19}'),(918,'fr','41','App\\Models\\ReleaseContent','{\"id\":41,\"content\":\"<p>وتم إطلاق هذا البرنامج الشامل، المخصص للمقاولات الناشئة، من قبل القناة الثانية وبشراكة مع إنوي. ويجسد التزام الشريكين بتعزيز الاقتصاد الرقمي الجديد ودعم نمو المقاولات المغربية الناشئة.&nbsp;<\\/p><p>وصرح سليم الشيخ، المدير العام لمجموعة \\\"SOREAD 2M\\\" قائلا: » نحن سعداء بالاهتمام والإقبال الذي عرفه البرنامج سواء على شاشة التلفزيون أو على المنصات الرقمية. لقد سجلنا نسب مشاهدة قياسية تؤكد الإهتمام الذي يوليه المغاربة للإستثمار والمقاولات ببلادنا. وبصفتنا وسيلة إعلام مواطنة ذات منفعة عامة، كان هدفنا من البرنامج هو المساهمة في خلق ديناميكية مقاولاتية جديدة لدى الشباب وتوفير الوسائل اللازمة للتعريف بمشاريعهم والحصول على مواكبة قيمة. ونتمنى أيضا أن نكون قد أعطينا لشباب آخرين فرصة دخول عالم المقاولات. «<\\/p><p>وعبرت نادية رحيم، مديرة العلامات التجارية والتواصل لدى إنوي قائلة:» نحن فخورون بمواكبة المقاولات الناشئة المغربية ومساهمتنا في التعريف بها لدى العموم عبر هذا البرنامج الذي حقق نتائج إستثنائية على كل المستويات. وبتوالي برايمات البرنامج تم تقديم مشاريع مبتكِرة وذات قيمة مضافة في عدة مجالات. ويواصل إنوي بذلك مواكبته للمقاولات الناشئة المغربية لمساعدتها على تحقيق مشاريعها وتسريع وتيرة نموها. «<\\/p><p>وصرح مهدي علوي، المدير التنفيذي والمؤسس لـ \\\" LaStartupFactory \\\" قائلا: » تمكن هذا البرنامج من إدخال مفهوم المقاولات الناشئة إلى كل البيوت المغربية وتحفيز الملايين من الشباب في مجال المقاولات المبتكرة وإعطائهم الأمل والثقة. هذا البرنامج التلفزي هو بمثابة نموذج تفكير جديد تشهده بلادنا. ويعتبر برنامج \\\"شكون غادي يستثمر في مشروعي؟ \\\" فرصة ملموسة للتمويل لكل مقاولة ناشئة ومواكبتها من طرف مستثمرين ناجحين. وبانتهاء الموسم الأول من هذا البرنامج سيتم مواصلة مواكبة المقاولين من طرف \\\" LaStartupFactory\\\" للحصول على تمويلات لمشاريعهم وتسريع وتيرتها. «&nbsp;<\\/p>\",\"title\":\"\",\"release_id\":19}'),(919,'fr','20','App\\Temoignage','{\"id\":20,\"message\":\"test tmoinagetest tmoinagetest tmoinagetest tmoinagetest tmoinage\",\"status\":true,\"user_id\":280,\"order\":1}'),(920,'fr','91','App\\Models\\Event','{\"id\":91,\"title\":\"test evenemnt\",\"description\":\"<p>test evenemnttest evenemnttest evenemnttest evenemnttest evenemnt<\\/p>\",\"view_count\":0,\"cta_inscription_externe\":\"null\",\"live_label\":null}'),(921,'fr','83','App\\Models\\Project2','{\"id\":83,\"lastname\":\"Ayoub\",\"firstname\":\"Battah\",\"function\":\"informatique\",\"organisme\":\"xelops\",\"city\":\"casablanca\",\"country\":null,\"startup_name\":null,\"startup_logo_name\":null,\"office_address\":null,\"maturity_stage\":null,\"website\":null,\"startup_description\":null,\"startup_video\":null,\"problem\":\"sasasas\",\"solution\":\"sasa\",\"solution_how\":\"sasasasasa\",\"market\":\"sasasa\",\"market_size\":\"asasa\",\"market_user\":\"sasas\",\"client1\":\"sasa\",\"client2\":\"sasa\",\"pricing_model\":\"sasasas\",\"challenges\":\"sasasa\",\"goal\":\"sasasasasa\",\"more_docs\":null,\"more_docs_name\":null,\"question1\":null,\"question2\":null,\"question3\":null,\"evaluation_5\":0,\"evaluation_6\":0,\"evaluation_7\":0,\"evaluation_8\":0,\"comment_2\":\"\",\"question1_2\":null,\"question2_2\":null,\"question3_2\":null}');
